INSERT INTO `authors` VALUES ('Academy.vn','http://academy.vn/wp-content/uploads/2014/01/Academy.jpg','Product Manager at Kenhcong Online Advertising'),('Andrew Davey','https://lh3.googleusercontent.com/-hSB8ma9wcrM/VhsW5QqJu3I/AAAAAAAAN1k/iHNa0nM9cNA/h120/Bio%2BShot.png\");','CEO & Founder Prodigy English'),('Bianca Rayner','https://static.edumall.vn/uploads/images/instructors/bianca.png','Bianca là một giáo viên người Úc đã có kinh nghiệm giảng dạy về giao tiếp tiếng Anh 2 năm ở Việt Nam. Bên cạnh đó, Bianca là một nhà phát triển cộng đồng đầy kinh nghiệm đầy nhiệt huyết và đam mê. Cô đã từng làm việc với rất nhiều tổ chức làm về phát triển, quản lý và áp dụng các dự án vào cộng đồng. Cô có nhiều kinh nghiệm trọng việc phát triển và điều hành các dự án về cộng đồng, phát triển các đề xuất gọi vốn và quản lí ngân quỹ. Cô cũng có kinh nghiệm trong việc quản lí nhân viên, đào tạo, hợp tác dịch vụ, phát triển chính sách và lập kế hoạch chiến lược.\nKinh nghiệm làm việc:\nNhân viên hoạch định phát triển của Vredeseilanden-VECO Việt Nam.\nPhòng nghiên cứu và phát triển giáo dục tại chương trình học Tiếng Anh trực tuyến TOPICA NATIVE (TOPMITO)\nPhòng Sức khỏe và An toàn của hội đồng Mitchell Shire.\nXem chi tiết'),('Cao Thanh Thảo My','https://lh5.googleusercontent.com/-hHVescAtIRg/UtzeUqQdCeI/AAAAAAAAEvw/meE6Rox33to/s100-no/Gv-Thaomy.jpg\");','Top 5 Vietnam Idol 2012'),('Cao Thị Thùy Liên','https://lh5.googleusercontent.com/-pAa_9zslnc8/VS4brrQ5whI/AAAAAAAAMig/PHnT6JhV_J8/s384-no/%E1%BA%A3nh%2Bgv%2B_%2Bhoach%2Bdinh%2Btai%2Bchinh.png\");','Thạc sĩ'),('CLB Pháp Chế Doanh Nghiệp','https://lh3.googleusercontent.com/-g7lNYO92PVM/VYtukqUO7pI/AAAAAAAANPE/xJbv-UKq5as/s512/lo%252520go%252520CLB.jpg\");','Câu lạc bộ Pháp chế doanh nghiệp'),('DeltaViet Education','https://lh6.googleusercontent.com/--UnO6XVzaCY/VAbly0T7sSI/AAAAAAAAG_o/bFBdvrOJ4HU/s180-no/avar-deltaviet.jpg\");','Đơn vị sở hữu website học online Kyna.vn'),('Dương Ngọc Dũng','https://lh5.googleusercontent.com/-tIdnyqei5FI/UzE-xB32WVI/AAAAAAAAFCg/EB6PB2d6X0o/s100-no/gv-duongngocdung.png\");','Tiến sĩ Tôn giáo học, ĐH Boston'),('Đặng Đình Khanh','http://3.bp.blogspot.com/-IwhJbPbUoU8/UKVCt_lCKxI/AAAAAAAAAgE/_MvIN1PYyBA/s1600/dang-dinh-khanh,-%C4%91%E1%BA%B7ng-%C4%91%C3%ACnh-khanh.jpg\");','Giảng viên'),('Đặng Minh Tuấn','https://static.edumall.vn/uploads/images/instructors/dang-minh-tuan.png','Đặng Minh Tuấn là một chuyên gia trong lĩnh vực lập trình web, có nhiều năm kinh nghiệm giảng dạy môn lập trình web. Anh là giảng viên tại Học viện đào tạo lập trình viên Aptech từ năm 2008 - 2010.\nNăm 2010, anh sáng lập và điều hành website hoctudau.com, website dạy học lập trình web trực tuyến. Website đã đào tạo những học viên ưu tú, có đóng góp cho CNTT nước nhà.\nCâu nói yêu thích của anh là: Hãy cứ đam mê, hãy cứ dại khờ tuổi trẻ được quyền thất bại, hãy bắt tay vào làm sẵn sàng học lại từ đầu, làm lại từ đầu.'),('Đặng Ngọc Bình','https://static.edumall.vn/uploads/images/courses/avatar_binhdn.avatar.jpg','Có kinh nghiệm giảng dạy thiết kế website tại Trung tâm APPNET - 1 nơi đào tạo về Internet Marketing kết hợp với Trung tâm điện toán ĐH Bách Khoa TP.HCM.\nCông việc hiện tại của Bình là tổ chức đào tạo khóa học về WordPress, công cụ giúp mọi người có được website dễ dàng mà tốn rất ít chi phí. Anh cũng viết sách \"Thiết kế web siêu tốc\" học thiết kế web dành cho người không chuyên IT với mong muốn kiến thức có thể tiếp cận đến nhiều người hơn nữa. Ngoài ra, anh còn xây dựng Video khóa học để chia sẻ những kĩ năng thật hữu ích này tới cho mọi người.'),('Đặng Thanh Vân','https://lh3.googleusercontent.com/-NxTn-3Ut-_c/VguLbiQfJ9I/AAAAAAAANzc/SbehN_eLOd4/s576-Ic42/Giang%252520vien-%252520Dang%252520Thanh%252520Van-%2525202.jpg\");','Founder & CEO, Công ty Tư vấn Thương hiệu và Truyền thông THANHS'),('Đặng Trần Lê Vũ','/media/images/avatar_teacher/ava_tran_vu.jpg\");','Acoustic Guitar Tutor'),('Đào Chi Anh','https://lh3.googleusercontent.com/-WC0GCSEdSTA/VT39xK9pKTI/AAAAAAAAMr8/8BbU3KAEeas/s400-no/co%2Bchi%2Banh.png\");','Chuyên gia ẩm thực'),('Đào Đức Dũng','https://static.edumall.vn/uploads/images/courses/avatar_ava---dao-duc-dung.jpg','Doanh nhân, triệu phú - ĐÀO ĐỨC DŨNG\nTừng nổi danh như một bậc thầy bán hàng và kiếm được $4000/tháng ngay từ khi còn trên ghế nhà trường, doanh nhân - diễn giả Đào Đức Dũng được gọi với cái tên \"triệu phú sinh viên\". Hiện nay, anh đang tiếp tục xây dựng và sở hữu các doanh nghiệp đáng giá triệu đô. Tuy nhiên, không chỉ dừng lại ở việc làm giàu cho bản thân, anh còn là một diễn giả rất tích cực, chia sẻ các bí quyết làm giàu. Bằng những kiến thức, kĩ năng sâu sắc về khởi nghiệp, bán hàng, cũng như những kinh nghiệm lâu năm trong kinh doanh, doanh nhân Đào Đức Dũng đã chắp cánh ước mơ cho hàng ngàn bạn sinh viên có mong muốn khởi nghiệp.\nAnh là tác giả cuốn sách bán chạy nhất về đề tài khởi nghiệp \"Bí mật của những đại gia sinh viên\"\nQuá trình công tác:\nHiệu phó trường THPT Lương Văn Can\nXem chi tiết'),('Đỗ Thanh Tùng','https://static.edumall.vn/uploads/images/courses/avatar_vlcsnap-2137-03-23-13h05m20s048.png','Đỗ Thanh Tùng hiện đang công tác tại Ngân hàng TMCP Sài Gòn - Hà Nội (Vietcombank). Năm 2014, anh được Trung Ương Hội Thanh niên Việt Nam tặng bằng khen trong chương trình 1.000 Giảng viên Doanh nhân tham gia cuộc vận động “Thanh niên lập thân, lập nghiệp làm giàu chính đáng” (là 1 trong 30 Giảng viên được nhận bằng khen)'),('Đỗ Thị Yến','https://static.edumall.vn/uploads/images/courses/avatar_img_4929.jpg','Tốt nghiệp Thạc sỹ quản trị kinh doanh tại Đại học Hawaii, Hoa Kỳ\nGiám đốc điều hành GPO, công ty tư vấn, tuyển dụng và đào tạo nhân sự chuyên nghiệp\nBậc thầy trong lĩnh vực tư vấn tuyển dụng cho doanh nghiệp\nGiám đốc đào tạo, Giám đốc tuyển dụng vùng của những tổ chức quốc tế như LG, Nortel Networks, Techcombank… đã từng chọn lọc hàng trăm ngàn CV, phỏng vấn hàng ngàn người ở các vị trí từ thấp tới cao cấp'),('Đoàn Cẩm Tú','http://demo.academy.vn/wp-content/themes/academy/images/bgs/testimonial_bg.png','Trưởng Bộ Môn Tài Chính Kế Toán Trường Đại Học Hoa Sen'),('Egbert Veltman','https://static.edumall.vn/uploads/images/instructors/egbert-veltman.jpg','Trình độ học vấn:\n- Bằng thạc sĩ về quan hệ quốc tế tại trường đại học Amsterdam\n- Bằng cử nhân về luật tại trường đại học Amsterdam\nKinh nghiệm:\n- Giảng viên nhóm nghiên cứu của bộ Ngoại Giao tại đại học Amsterdam\nXem chi tiết'),('Hà Trọng Ngự','https://lh5.googleusercontent.com/-bLXmucieIVk/VT29G-epd8I/AAAAAAAAMro/IUmzclCZfnw/s529-no/hinh-giang-vien.jpg\");','Võ sư võ cổ truyền'),('Hồ Phụng Hoàng Phoenix','https://3126454c484102f0e4d0c1454fb19e79de99f8e6.googledrive.com/host/0B4ypLi3tIUAvWElTWFVjSmV4eTg/1488212_940680362612580_1104312760374737863_n.jpg\");','Career Manager - Trường Đại học Quốc tế RMIT'),('Hồ Trần Hiếu Trung','http://3hoc.vn/uploads/avatar/norms/3hoc_f641ba84_3hoc-ho-tran-hieu-trung.jpg','Giải 4 Thế Giới môn Microsoft PowerPoint'),('Hoàng Thùy Vân','https://lh4.googleusercontent.com/-14j_MTDxPZ4/VRptjs6yEJI/AAAAAAAAMMk/C1v2P74UitQ/s499-no/%E1%BA%A2nh%2Bc%C3%B4%2BV%C3%A2n%2B-%2BKh%C3%B3a%2Bti%E1%BA%BFng%2BNh%E1%BA%ADt.jpg\");','Thạc sĩ Ngôn ngữ học, Đại học Senshu, Nhật Bản'),('Hoàng Trọng Nghĩa','https://lh3.googleusercontent.com/-AGKHlc5ponQ/Vic8ZBs6QXI/AAAAAAAAN3s/hH6UnWuOEUk/s512-Ic42/Hoang%252520Trong%252520Nghia-%252520avatar.JPG\");','CEO Công ty CP Hướng nghiệp và Phát triển Giáo dục ICANDO'),('Huỳnh Minh Thuận','https://lh3.googleusercontent.com/-OiJzUMYaTMI/VBaloIDfsbI/AAAAAAAAHcw/QzOluFbNc3Y/s100-no/gv-huynhminhthuan.jpg\");','CEO BrandYou'),('Huỳnh Ngọc Trụ','https://lh3.googleusercontent.com/-hzhiiVmMOyQ/VFsGBh92lEI/AAAAAAAAJUg/yUAOZ7Db8GM/s100-no/DSC03271.JPG\");','TGĐ Công ty Đào tạo & Phát triển Tầm Nhìn Việt'),('La Kiến Mỹ','https://lh3.googleusercontent.com/-mUUnCG4FuHs/VJE-OyiCZQI/AAAAAAAAKFk/mgidDXwjHYs/s150-no/gv-la-kien-my.jpg\");','MBA, Chuyên gia đào