viên theo học và đã từng dạy hàng nghìn người đam mê guitar\nTài khoản youtube chuyên về hướng dẫn guitar của giảng viên hiện đang có hơn 100.000 người theo dõi\nXem chi tiết'),('Nguyễn Tiến Nghĩa','https://static.edumall.vn/avatars/Nguyen-Tien-Nghia-1458186291.png','Với hơn 7 năm kinh nghiệm về Digital, Nghĩa là 1 trong số các đại diện hiếm hoi đến từ Việt Nam tham gia các chương trình của Google: Google Meetup Đông Nam Á (là 1 trong 5 người Việt Nam tham dự), Google Summit tại thung lũng Silicon (Mỹ) và một số chương trình khác tại Malaysia...\nAnh cũng được Google chứng nhận và công nhận là Chuyên gia toàn cầu về Google Adwords (vượt qua 2 kỳ thi cơ bản & nâng cao); ghi nhận là Top Contributor về Adwords (do có kiến thức adwords chuyên sâu, thực hành thực tế trên nhiều tài khoản, giúp đỡ cộng đồng Adwords toàn Việt Nam về Adwords).\nNgoài ra, Nghĩa còn có kinh nghiệm giảng dạy về Google Adwords tại các trung tâm Ispace, Hoàng Nguyễn, DGM...'),('Nguyễn Trí Hoàng Dương','https://lh3.googleusercontent.com/-A-0j_0XOcHg/VmFfU3_pKOI/AAAAAAAAOPs/peqC26eIlMY/s509-Ic42/Avatar.png\");','Giảng viên Đồ Họa'),('Nguyễn Văn Kỳ','https://static.edumall.vn/uploads/images/courses/avatar_kynv.avatar.jpg','- Thạc sĩ Nguyễn Văn Kỳ\n- Nơi công tác hiện tại: Trường Đại Học Thành Tây\n- Hơn 5 năm kinh nghiệm giảng dạy\n- Hơn 10 năm kinh nghiệm làm việc với excel\n- Từng cộng tác nghiệp vụ kế toán cho các doanh nghiệp lớn'),('Nguyễn Vĩnh Bảo','https://static.edumall.vn/uploads/images/courses/avatar_10402988_920173641328843_7340150001803303634_n.png','- Học bổng toàn phần bậc Đại học – Đại học Quốc Tế RMIT\n- Thủ khoa tốt nghiệp 2015 - Đại học Quốc Tế RMIT\n- Học bổng toàn phần thạc sĩ Kinh doanh quốc tế – Đại học Quốc Tế RMIT\n- Giải thưởng Lãnh đạo của trường Đại học Quốc tế RMIT\n- Đại biểu Việt Nam tại nhiều hội nghị tại Úc, Indonesia, Thái Lan, Malaysia, Campuchia...\n- MC cho nhiều chương trình của Unilever, Suntory Pepsico, CPA Australia, RMIT, AIESEC Hanoi…'),('Nguyễn Vĩnh Cường','https://static.edumall.vn/uploads/images/instructors/nguyen-vinh-cuong.png','Diễn giả - Doanh nhân triệu phú Nguyễn Vĩnh Cường\nChuyên gia Marketing Online với hơn 11 năm kinh nghiệm\nChuyên gia tổ chức hội thảo Marketing với hàng nghìn học viên\nĐôi nét về tiểu sử tác giả:\n- Nhà báo tại báo Bóng đá năm 2002 - 2007\nXem chi tiết'),('Nguyễn Vũ Đức Thuận','https://lh3.googleusercontent.com/-RJFcr_nalhc/UhMbwGoBW2I/AAAAAAAAEaQ/47qBm9H81tM/s200-no/hinh_gv2.jpg\");','Giảng viên Trường Quản Trị Cuộc Đời LiMA'),('Nhữ Bảo Vũ','https://static.edumall.vn/uploads/images/courses/avatar_vunb.jpg','Học viên cao học khoa Công nghệ thông tin, trường Đại học Công nghệ - ĐH Quốc gia Hà Nội\nKỹ sư phần mềm, trưởng nhóm lập trình tại Trung tâm Giải pháp và phát triển phần mềm, công ty VNPT Technology\nXây dựng các giải pháp và phát triển các phần mềm đám mây WIFI Cloud Controller, các dự án NMS tại VNPT Technology\nXây dựng các giải pháp và phát triển các dịch vụ VAS viễn thông: các dự án AllBlocking, 7Color, DCOM, IPTV tại Viettel ICT\nHơn 8 năm học tập và làm việc trong lĩnh vực công nghệ phần mềm\nXem chi tiết'),('Ninh Đôn','https://static.edumall.vn/uploads/images/courses/avatar_ninh_don.jpg','Tôi là Ninh Đôn - Chuyên gia kiếm tiền trên internet, đặc biệt là Youtube. Tôi đã sáng lập đồng thời đảm nhiệm vai trò giám đốc Công ty Cổ phần Công nghệ First Việt Nam khi mới 20 tuổi.\nTôi có một sự yêu thích rất lớn đối với Youtube cùng ước mơ giúp đỡ mọi người xây dựng thu nhập thụ động từ Internet và từng ngày, tôi đều sống và làm việc với ước mơ ấy của mình.\nTôi có các kỹ năng chuyên môn trong lĩnh vực kỹ thuật và Internet Marketing, các chuyên môn chính của mình đó chính là xây dựng & lập trình website, WordPress, SEO, MMO, Phần mềm và sáng tạo trong công việc, luôn tìm tòi và cập nhật công nghệ để tối ưu hóa hơn năng xuất và hiệu quả khi làm việc.\nVới hơn 5 năm kinh nghiệm trên Internet, hiện tại thu nhập của tôi là từ những nguồn sau:\nGoogle Adsense: Trên một số vị trí của website có đặt một số banner quảng cáo từ Google, các sản phẩm có ích và từ những đối tác đã mua quảng cáo.\nXem chi tiết'),('Phạm Anh Tuấn','https://static.edumall.vn/uploads/images/courses/avatar_anh-tuan.jpg','Hiện là Trưởng phòng đào tạo Công ty Cổ phần vàng bạc đá quý Phú Nhuận (PNJ), giảng viên thỉnh giảng Đại học Kinh tế TPHCM, Đại học Mở TPHCM và Chương trình cử nhân trực tuyến Topica.\nĐã tốt nghiệp thạc sĩ ngành quản trị kinh doanh, có kiến thức chuyên môn sâu và kinh nghiệm 12 năm về quản trị nhân sự, bán hàng, kỹ năng sống.\nTừng tham gia Ban giám khảo nhiều cuộc thi dành cho sinh viên tại TPHCM và bản thân tham dự đạt giải CEO xuất sắc nhất tháng trong chương trình CEO Chìa Khóa Thành công do VTV tổ chức từ năm 2009. Giảng dạy tại Đại học Mở TPHCM từ năm 2006 và thuyết trình nhiều chương trình dành cho sinh viên cũng như tại các doanh nghiệp lớn.\nAnh Tuấn cũng là tác giả trên website Dotchuoinon.com, một trang web chuyên về tư duy tích cực.'),('Phạm Hoàng Yến','https://lh3.googleusercontent.com/-r6IWUH-NJw0/VZ5Sr-Lc1JI/AAAAAAAANV0/xxN2X9faqPk/s413-Ic42/phat%252520trien%252520nao%252520tre.jpg\");','Giám đốc Công ty Cổ phần Sunshine Village'),('Phạm Hồng Phong','https://static.edumall.vn/uploads/images/courses/avatar_untitled-2.jpg','- 4 năm kinh nghiệm làm việc với PHP+ Mysql.\n- Triển khai nhiều hệ thống lớn sử dụng các framework như Yii, Zend,Ci. Sử dụng nhiều công nghệ caching như redis, memcache.\n- Kinh nghiệm làm việc với các search engine: solr, elastics\n- Kinh ngiệm làm việc với NoSQL: mongoDB, Cassandra\n- 1 năm kinh nghiệm với big data và python. Hệ thống tính toán phân tán: apache spark, hadoop\n- Hiện đang là senior software engineer tại công ty Orenj Technology'),('Phạm Hùng Thắng','https://static.edumall.vn/uploads/images/courses/avatar_avatar_photo.jpg','Founder & CEO: HEADS Technology & Communications Academy\nFounder & CEO: Công ty Cổ phần Công nghệ và Dịch vụ HTViet\nFounder & CEO: Vitot.vn - Chỉ bán sản phẩm tốt\nFounder & CEO: Vitot Seafood - Hải Sản tươi sống thực phẩm sạch\nGiảng viên cao cấp và là người sáng lập ra khóa học duy nhất hiện nay trên thị trường đào tạo: MBAVIP - Marketing & Business VIP\nXem chi tiết'),('Phạm Quang Vinh','https://static.edumall.vn/uploads/images/courses/avatar_ffffff.jpg','Bằng cấp chuyên môn: Thạc sĩ Khoa học Máy tính\nKinh nghiệm làm việc: Giảng dạy tin học và Công tác liên tục trong lĩnh vực Công nghệ Thông tin 21 năm\nThành tích:\n- Năm 1998: Tham dự Đội tuyển Olympic Tin học Sinh viên Toàn Quốc.\n- Năm 2015: Bằng khen của Trung ương Hội Liên hiệp Thanh Niên về công tác Giảng dạy Công nghệ thông tin hỗ trợ Thanh niên lập nghiệp.'),('Phạm Quốc Khánh','https://lh4.googleusercontent.com/-6ghD1jcJ81o/VTTH8shbUlI/AAAAAAAAMnM/oPgI-XLXG2E/s295-no/%E1%BA%A3nh%2B2.jpg\");','Luật gia, Thạc sĩ Kinh tế'),('Phạm Thanh Chí','https://static.edumall.vn/uploads/images/courses/avatar_chipt.avatar.png','Tôi tên là Phạm Thanh Chí, sau quá trình học tập tại khoa Công nghệ thông tin của Học viện giáo dục và Hà Nội Aptech, tôi bắt đầu bằng việc trở thành lập trình viên Mobie tại nhiều công ty khác nhau trong và ngoài nước . Với sở thích tìm hiểu cái mới, thường xuyên cập nhật công nghệ, tới đầu năm 2014, tôi cùng đồng nghiệp đã thành lập CFF Studio - chuyên mảng phát triển và phân phối Game mobile thị trường trong nước và start - up của tôi cũng đã ghi dấu nhiều thành công . Hi vọng với kiến thức 8 năm tìm hiểu về phát triển mobile, game, publisher mobile game, tôi có thể giúp các bạn trên con đường trở thành lập trình viên thực thụ.'),('Phạm Thanh Hà','http://3hoc.vn/uploads/avatar/norms/3hoc_b56a4f8c_3hoc-pham-thanh-ha.jpg','Chuyên gia tài chính'),('Phạm Thị Thúy','https://3126454c484102f0e4d0c1454fb19e79de99f8e6.googledrive.com/host/0B4ypLi3tIUAvWElTWFVjSmV4eTg/XG4P2967.jpg\");','TS Xã hội học, Th.S Tâm lý học lâm sàng'),('Phạm Thu Trang','http://academy.vn/wp-content/uploads/2015/03/Pham-Thi-Thu-Trang_MG_2082_03.jpg','Digital Planning Director - Brandon Media'),('Phạm Văn Chính','https://static.edumall.vn/uploads/images/courses/avatar_ava_chinhpv.jpg','Ông là chuyên gia tư vấn cao cấp dày dặn kinh nghiệm trong công tác quản lý về nhân sự.\nÔng đã có 19 năm kinh nghiệm làm Giám đốc nhân sự cho các công ty như: Samsung Electronics, Carings, Philips, United International Pharma.\nBên cạnh đó, ông cũng có hơn 10 năm kinh nghiệm giảng dạy quản trị nhân sự và các kỹ năng mềm cho các công ty trong và ngoài nước như:\n+ Bộ Tư pháp, Tập đoàn dầu khí Quốc gia Việt Nam, Petrolimex, MobiFone, Viettel...\n+ Samsung, Prudential Việt Nam, H.I.S (Nhật Bản), Công ty Cổ phần Thực phẩm Quốc tế Interfood...\nNgoài ra, ông còn là giảng viên cao cấp thuộc trường Doanh nhân PTI - Tổ chức Giáo dục PTI'),('Phan Công Chánh','http://kyna.vn/media/landing_theme/images/cmb_bds/img-banner-top.png\");','Chuyên gia bất động sản cá nhân'),('Phan Kiều Trang','https://lh3.googleusercontent.com/-QtkePSHQ7n4/VuOgJ8nWJeI/AAAAAAAAAlY/wFpN65-DZjoA_qF_GyPCU9xiOgUs9IV2wCCo/s230-Ic42/AVA%2BPKT.jpeg\");','Giám đốc trung tâm Anh ngữ Elight'),('Phan Phúc Thắng','https://static.pedia.vn//uploads/images/courses/course_image_ppt-avatar.png','Phan Phúc Thắng quê ở Hà Tĩnh là nhà sáng lập & điều hành tổ chức giáo dục Lời Nói Nói Vàng, anh được biết nhiều với vai trò là diễn giả sâu sắc mà một MC hài hước, thông minh và hóm hỉnh. Với sự đa tài của mình, anh đã chinh phục rất nhiều giải thưởng\n- Năm 2015: MC cho chương trình Cười Xuyên Việt – Phiên bản Nghệ sĩ, Giải 3 Cười Xuyên Việt, Thí sinh có những đóng góp sáng tạo cho Cuộc thi Người Dẫn Chương Trình 2015\n- Năm 2013: Quán quân cuộc thi “Speakers Got Talent”\n- Năm 2010: Đạt giải cuộc thi Người Dẫn Chương Trình Truyền Hình BRT\nNgoài khả năng nói, anh còn thể hiện khả năng sử dụng ngôn từ của mình qua nhiều tác phẩm khác nhau như truyện ngắn, truyện dài, sách viết kỹ năng…\nXem chi tiết'),('Phan Quốc Huy','https://3126454c484102f0e4d0c1454fb19e79de99f8e6.googledrive.com/host/0B4ypLi3tIUAvWElTWFVjSmV4eTg/hinh.jpg\");','Giám đốc Công ty TNHH TM và DV Tin Học Huy Training'),('Phan Thanh Bình','https://static.edumall.vn/uploads/images/courses/avatar_ava_binhpt.jpg','Ông có nhiều năm kinh nghiệm trong lĩnh vực xây dựng kế hoạch phát triển kinh doanh cũng như chiến lược Marketing cho các công ty trong và ngoài nước.\nCùng với đó là kinh nghiệm trong việc giảng dạy và đào tạo về nghiệp vụ chăm sóc khách hàng, kỹ năng giao tiếp cơ bản và nâng cao, quản trị nguồn nhân lực cho các công ty lớn như: Vietnam Airlines, Nokia, Fujitsu, Yamaha, Fpt, Vietcombank, Cocacola...'),('Phan Văn Luân','https://static.edumall.vn/uploads/images/courses/avatar_untitled-4.jpg','Thầy Phan Văn Luân đã từng làm việc tại FPT với vai trò technical leader, đồng thời là giảng viên đào tạo các khóa fresher của FOT.\nLàm việc tại LINE cũng là team leader đội phát triển ứng dụng Mobile.\nLà founder của trang web chuyên chia sẻ các kỹ năng lập trình web laptrinh.io\nTham gia và các dự án mã nguồn mở trên thế giới liên quan tới các nền tảng framework như Laravel, lonic, Framework, Codeconcept JS.\nLà một blogger về kỹ thuật chia sẻ hướng dẫn một số thủ thuật lập trình trên trang blog cá nhân blog.petehouston.com'),('Phó Hải Đăng','https://lh3.googleusercontent.com/-yIodIHObgfs/VHvmKe2PdTI/AAAAAAAAJ2E/pRjRTJLS4xk/w150-h147-no/gv_hai_dang.JPG\");','Thạc sỹ Khoa Học Máy Tính'),('RichdadLoc','https://lh3.googleusercontent.com/-d9NjLx5OMTY/VD3ta0aQSxI/AAAAAAAAIq8/e_zCLBwfqMM/s125-no/thayloc.png\");','CEO Onnet - Chuyên gia Marketing Online'),('Sắp ra mắt','https://static.edumall.vn/assets/default-avatar-7081cb38a5e8cc8adf5e6d08d62b3d4c58db820ed571ee4bd1130c2f8bad12c8.png',''),('Seb Trần','https://lh6.googleusercontent.com/-QL_7XZUCAf0/VC4YqTwHqwI/AAAAAAAAISI/N_cm2tktKbY/s100-no/gv-seb-tran2.jpg\");','CEO Cty Truyền thông Châu Á'),('TFI','https://static.edumall.vn/uploads/images/courses/avatar_tfi.jpg','Topica Founder Insitute là bệ phóng duy nhất của Việt Nam có doanh nghiệp học viên gọi vốn thành công hàng triệu đô. Tổng cộng học viên 3 khoá đã gọi được khoảng 10 triệu USD, 28 doanh nghiệp tốt nghiệp, 3 khoá đã tổ chức hàng năm từ năm 2011 tại HN và TPHCM. Startups tốt nghiệp tiêu biểu: Appota, Giaytot, Yton, S3, Kyna, Beeketing, Vlance, Goong, Hisella, Antoree, Uplevo...'),('Thạc Bình Cường','https://static.pedia.vn//uploads/images/courses/course_image_avar-thay-thac-binh-cuong.jpg','Thầy Th.S Thạc Bình Cường giảng viên khoa CNTT trường ĐH Bách khoa Hà Nội, giảng viên chương trình Kỹ sư tin học ứng dụng (IT) của Topica.\nÔng là tác giả của rất nhiều giáo trình chuyên ngành Công Nghệ Thông Tin, được sử dụng trong giảng dạy bộ môn công nghệ thông tin của các trường đại học trên cả nước. Một số sách ông đã xuất bản như: Lập trình Web và ứng dụng, NXB Giáo dục, 2008. Kiểm thử và bảo đảm chất lượng phần mềm, Nhà Xuất bản ĐHBK năm 2011 Tin học văn Phòng, NXB Giáo dục, 2007 Ngôn ngữ lập trình PASCAL, NXB Giáo dục, 2006 Quản trị dự án phần mềm, NXB KHKT, 2005, Phân tích và thiết kế HTTT, cách tiêp cận hiện đại , NXB ĐH Sư phạm, năm 2002 Phân tích và thiết kế hệ thống thống tin, NXB Khoa học kỹ thuật , năm 1999 Nhập môn Công nghệ phần mềm, NXB giáo dục.\nNgoài lĩnh vực công nghệ thông tin, ông còn là một chuyên gia có uy tín trong lĩnh vực kỹ năng mềm: Giao tiếp, lãnh đạo, đàm phán, Tiếng Anh chuyên ngành CNTT, NXB KHKT'),('Thạc sĩ Johnny Thông','https://static.edumall.vn/uploads/images/courses/avatar_img_9041--1-.jpg','Chuyên gia Marketing - Thạc sĩ Johnny Thông\nSống và học tập bên Mỹ, tác giả Thạc sĩ Johnny Thông luôn dành thời gian và tâm huyết với ngành social media marketing. Hiện nay, anh đang tiếp tục sở hữu các khóa học về marketing, với mong muốn có thể định hướng cho những người đam mê học hỏi và khao khát trở thành một chủ doanh nghiệp theo mô hình kinh doanh online từ khi còn trẻ.\nQuá trình công tác:\nGiảng viên đào tạo cho các học viên công ty: Uniliver, Coop Mart, Nitifood, Sài Gòn Tourist, Masan food, LG, Vật Giá, HSBC, PetroVietnam, Sacombank, CMC, Nokia,..\nChủ Tịch Công Ty Cổ Phần Khai Thác Và Quản Lý Bất Động Sản JT7 ( Đầu Tư Theo Phong Cách Robert kiyosaki)\nXem chi tiết'),('Thạc sỹ Nguyễn Danh Tú','https://static.edumall.vn/uploads/images/instructors/nguyen-danh-tu.png','Nguyên Giám đốc tài chính cho Doanh nghiệp có hơn 600 nhân viên\n15+ năm kinh nghiệm giảng dạy tại Đại học Bách Khoa Hà Nội và BKIndex\n5+ năm kinh nghiệm trong lĩnh vực sư phạm và đào tạo trên môi trường trực tuyến E-learning.\n12+ năm kinh nghiệm trong lĩnh vực Tin học văn phòng trong công việc và cải tiến quy trình\n20+ khóa học dành riêng cho người đi làm với chuyên đề Excel.\n100+ khóa giảng dạy chuyên đề, kỹ năng về ứng dụng CNTT trong làm việc'),('Thiên Trần','https://lh3.googleusercontent.com/-Pp1ZcK-4am0/VeBGFW0qpQI/AAAAAAAANn8/Tk3rUhdjqeI/s407-Ic42/Avatar.png\");','Chuyên gia Marketing - PR'),('ThS. BS. Lê Thị Hải','https://lh3.googleusercontent.com/-lQ5Tzldlr0Y/VuFB-2KRO3I/AAAAAAAAAiQ/1iGdRGC93yI/s326-Ic42/BS%252520Le%252520Thi%252520Hai.JPG\");','Nguyên Giám đốc Trung tâm khám tư vấn Dinh dưỡng- Viện dinh dưỡng Quốc gia'),('ThS/ MBA. Nguyễn Phan Anh','https://lh3.googleusercontent.com/-a7zMi0g6zsg/Vvo3RfnIg5I/AAAAAAAAA8o/dkJxyHVdEks2AEpASHgB3lGXqPtzsNWIwCCo/s512-Ic42/Phan%2BAnh%2BAvatar.jpg\");','Chuyên gia đào tạo, tư vấn và triển khai giải pháp về E-Commerce, E-Business, E-Marketing'),('Tiện ích văn phòng','https://static.edumall.vn/assets/default-avatar-7081cb38a5e8cc8adf5e6d08d62b3d4c58db820ed571ee4bd1130c2f8bad12c8.png','Tiện ích văn phòng - trang web chuyên về các ứng dụng, phần mềm để nâng cao hiệu suất làm việc văn phòng như Word, Excel, Power Point, Outlook,...'),('tientt','https://static.edumall.vn/uploads/images/courses/avatar_533870_209611932476317_427638277_n.jpg','Học tập tại Đại học Mỹ thuật Công nghiệp Hà Nội là bước khởi đầu thuận lợi để tôi tiến gần tới ước mơ trở thành nhà thiết kế của mình. Ngay từ khi ngồi trên giảng đường đại học, tôi đã tìm hiểu các phần mềm đồ họa Adobe Photoshop, Adobe Illustrator, Adobe Indesign, Corel Draw. Tới nay, tôi đã có hơn 7 năm tìm hiểu về thiết kế đồ họa và đạt được một số thành tựu: The incentive award \"12 Zidean\"(2013), Poster Film \"Lửa Phật \".\nTôi đang làm việc tại Solution Vietnam - Một trong những Doanh nghiệp đạt được thành công trong việc kết hợp kinh doanh giữa: lĩnh vực truyền thông quảng cáo, tổ chức sự kiện và thiết kế thi công nội ngoại thất hàng đầu Việt Nam. Tôi rất vui được đồng hành cùng các bạn trên con đường trở thành nhà thiết kế chuyên nghiệp.'),('Topica Native','https://static.edumall.vn/uploads/images/courses/avatar_topica-native.jpg','Nền tảng học Tiếng Anh trực tuyến, tập trung vào phát triển kỹ năng giao tiếp thông qua việc giúp Học viên luyện nói hàng ngày với Giáo viên Âu - Mỹ - Úc\nMỗi ngày, từ 8 giờ đến 24 giờ TOPICA Native mở các lớp học trực tuyến, Giáo viên bản ngữ sẽ giảng dạy trực tiếp cho Học viên qua lớp học trực tuyến được thiết kế trực quan, sinh động\nhttp://native.topica.vn/'),('Topica Uni','https://static.edumall.vn/uploads/images/courses/avatar_topica-uni.jpg','Cung cấp hạ tầng công nghệ và dịch vụ hỗ trợ cho các chương trình Cử nhân trực tuyến chất lượng cao của ĐH Kinh tế quốc dân, Viện đại học Mở Hà Nội, ĐH Thái Nguyên, ĐH Trà Vinh, ĐH Duy Tân, và ĐH AMA (lớn nhất Philippines). - 1000 giảng viên doanh nhân tham gia giảng dạy E-learning - 4600 cựu sinh viên TOPICA thành đạt trong đó có hàng trăm lãnh đạo, quản lý các doanh nghiệp https://topica.edu.vn/'),('Trần Duy Thanh','https://static.edumall.vn/uploads/images/courses/avatar_hahahahth.jpg','Về Sư Phạm:\nTham gia giảng dạy từ năm 2009, Thầy Trần Duy Thanh hiện là Thạc sĩ Khoa học Máy tính của các trường đại học lớn TP.HCM:\n1) Đại Học Công Nghiệp TP.HCM\n2) Đại Học Công Nghệ Đồng Nai (Trưởng Bộ môn Công nghệ Phần mềm)\n3) Đại Học Khoa Học Tự Nhiên TP.HCM - Trung Tâm Tin Học\nXem chi tiết'),('Trần Đình Tuấn','http://academy.vn/wp-content/uploads/2014/04/Tran-dinh-tuan.jpg','Giám đốc Công ty Tư vấn và đào tạo Cuộc Sống Đúng Nghĩa'),('Trần Đình Vĩ','http://3hoc.vn/uploads/avatar/norms/3hoc_f6882cb5_3hoc-tran-dinh-vi.jpg','Vô địch thế giới môn Microsoft Word'),('Trần Nam Anh','https://static.pedia.vn//uploads/images/courses/course_image_anh-tieu-su-tran-nam-anh.png','TRẦN NAM ANH - bậc thầy huấn luyện về giọng nói nổi tiếng trong và ngoài nước, với hơn 22 năm kinh nghiệm trong nghề.\nÔng xuất thân từ Huế, nhưng huấn luyện giọng cho nhiều ca sĩ, diễn viên miền Bắc và cả miền Nam. Đặc biệt, ông được công nhận là chuyên gia huấn luyện tiếng nói (Voice Coach), đã đào tạo và giúp cho rất nhiều diễn giả, MC, ca sĩ, diễn viên, xướng ngôn viên, hoa hậu,… thành công tuyệt đỉnh khi đứng trên sân khấu. Hiện ông là Trưởng Khoa tiếng nói trường Đại học Sân khấu điện ảnh Tp.HCM.\nKhách hàng tiêu biểu\nCác Đài phát thanh và truyền hình: Đài Tiếng nói nhân dân Tp HCM (VOH), VTV, HTV, Vĩnh Long (THVL), Bà rịa - Vũng tàu (BRT)...\nNVH Thanh Niên Tp.HCM: đào tạo hơn 60 khóa MC, 80 khóa Nghệ thuật nói chuyện trước công chúng.\nXem chi tiết'),('Trần Thị Ái Liên','https://lh4.googleusercontent.com/-Wu3zRjsU6bw/UZ7oQHHF_uI/AAAAAAAAEE8/UotbLhGcegI/s82-no/THs-Ailien.jpg\");','Sáng lập viên Bạn Của Bé'),('Trần Thị Bích Lan','https://lh3.googleusercontent.com/-WtZ5c7wmc4I/VjBD903_WfI/AAAAAAAAN7I/97bXawX_-Tw/h120/anh%2BCMT.jpg\");','Giảng viên Trường Đại học Thương Mại Hà Nội'),('Trần Thị Liễu','https://lh3.googleusercontent.com/-TSXSo2vuxzM/VjBDgj8kXXI/AAAAAAAAN68/vjU08Wi7WnA/h120/11218962_1062354387108593_5002280722910076267_n.jpg\");','Giám đốc trung tâm Ispeak English Center'),('Trang Minh Hà','http://academy.vn/wp-content/uploads/2014/05/Thac-si-trang-minh-ha.jpg','Training Manager Thienminh Group'),('Triệu Đình Nam','https://static.edumall.vn/uploads/images/courses/avatar_namtd.avatar.jpg','Triệu Đình Nam Sáng lập, Giám đốc Công ty TNHH Truyền thông Zoomations Là một nhà làm phim trẻ sinh năm 1987. Triệu Đình Nam được biết đến với vị trí khởi xướng dự án phi lợi nhuận quảng bá cảnh đẹp đất nước có tên gọi \"Vietnam is awesome project\". Các đoạn video với những góc quay cực kỳ đẹp và hoành tráng về thành phố Đà Nẵng, Sapa xuất hiện trong năm 2015 đã khiến không chỉ người dân Việt Nam mà cả cộng đồng quốc tế phải trầm trồ khen ngợi. Bản thân Đình Nam đã có 6 năm kinh nghiệm trong lĩnh vực truyền thông, từng tham gia hậu kỳ cho các chương trình truyền hình tại YANTV... Zoomations của Nam cũng là đơn vị sản xuất được nhiều công ty tổ chức sự kiện tin tưởng: HCM Run, Color me run, Iron man, Champion dash, Danang International Marathon...; là đối tác của nhiều đơn vị lớn như Sunrise Vietnam, Pulse Active, Khách sạn Mường Thanh, Nova land, YAN, Grab, Click Media, PWC,...'),('Trung tâm cộng đồng LIN','https://lh3.googleusercontent.com/-NGD8WgwKZLc/Vb9LLgYhhUI/AAAAAAAANg0/J-cNNUuRY2w/s150-Ic42/large_lin-logo-charity-map.jpg\");','Trung tâm cộng đồng LIN'),('Trương Minh Tuấn','https://static.edumall.vn/uploads/images/courses/avatar_untitled-3.jpg','Từng xây dựng hơn 50 dự án website, phần mềm quản lý trên nền tảng .NET\nTác giả của Sản phẩm iFsoft CMS WebControl - sản phẩm hiện nay đang được triển khai rất nhiều website doanh nghiệp\nTác giả của trang Blog hỗ trợ lập trình nền tảng .NET (http://truongminhtuan.info)\nHiện tại là Giảng viên giảng dạy bộ môn Tin học;'),('Tuấn Hải - Lê Hằng','https://lh3.googleusercontent.com/-m8D6LF8MlLg/VYIpq4VZixI/AAAAAAAANLc/H5_xKDZDJHU/s561-no/Hai%2BHang..jpg\");','Chuyên gia tư vấn'),('Vi Thành Kiên','https://static.edumall.vn/uploads/images/courses/avatar_kienvt.png','Với hơn 4 năm kinh nghiệm trong lập trình ứng dụng Android, tôi đã tự mình hoàn thành nhiều App trong nhiều lĩnh vực khác nhau: Tin tức, mạng xã hội, giải trí & nghe nhạc, từ điển...\nDưới đây là 1 số ứng dụng nổi bật của tôi:\nMeloCloud - Music Player: https://play.google.com/store/apps/details?id=com.ranhzaistudios.melocloud.free\nThe Straits Times SoShiok: https://play.google.com/store/apps/details?id=sg.vinova.soshiok_android\ntracau.vn : https://play.google.com/store/apps/details?id=vn.tracau.android'),('Viện Tâm lý và Giáo dục Pháp luật','https://3126454c484102f0e4d0c1454fb19e79de99f8e6.googledrive.com/host/0B4ypLi3tIUAvWElTWFVjSmV4eTg/Vientamly.png\");','Viện Tâm lý và Giáo dục Pháp luật'),('Vũ Hoàng Tâm','https://lh3.googleusercontent.com/JNz95kj7ykvRY53ngbqbhrycHdYOT747OuTQPR1CgWY=s200-no\");','Chuyên gia Mobile Marketing'),('Vũ Mạnh Cầm','https://lh3.googleusercontent.com/-_yXmwwH-L04/VdFJuVtjMjI/AAAAAAAANkI/qsMBwPEcuNM/s512-Ic42/Profile.jpg\");','Chuyên gia Facebook Marketing'),('Vũ Thị Hoài Anh','http://academy.vn/wp-content/uploads/2015/01/Vu-thi-hoai-anh.jpg','Giám đốc thương hiệu kênh truyền hình VTC10'),('Vương Mạnh Hoàng','https://static.edumall.vn/uploads/images/courses/avatar_hmhh.jpg','Vương Mạnh Hoàng - CEO Dịch vụ số.\n- Có 10 năm kinh nghiệm Marketing online, đã đào tạo Marketing online cho các tập đoàn lớn về công nghệ thông tin: FPT, CMC, LG, Samsung, VTC, VDC...\n- Triển khai dự án Marketing online cho các công ty Dược lớn: Sao Thái Dương, Hoa Sen, Phúc Hưng...\n- Đào tạo Marketing online cho các công ty BĐS: Cen group, Đất xanh, Khoải Hoàn, Vic...\n- Chuyên gia được mời giảng dạy thực tế cho doanh nghiệp nhiều nhất hiện nay.'),('Vưu Tiến Vĩ','https://lh3.googleusercontent.com/-Qy5LR_k2pIc/VjRsU9OkB2I/AAAAAAAAN9o/TaWN47lYpHA/h120/36.JPG\");','Giảng viên Trường Đại học Khoa học xã hội & Nhân văn TP.HCM');
