INSERT INTO `courses` VALUES (1,'Nghiên cứu và tìm hiểu Angular JS','Nhữ Bảo Vũ','Biết về AngularJS giúp bạn có công việc tốt hoặc cải thiện công việc bạn đang có. Đây là kỹ năng cần rất nhiều trong ngành công nghiệp phát triển Web hiện đại. AngularJS giúp bạn tạo các ứng dụng web dễ dàng hơn và đó là lý do tại sao nó trở nên rất phổ biến và được hỗ trợ bởi Google.\nKhóa học này giúp bạn tăng hiểu biết một cách nhanh chóng, dạy bạn những kiến thức cốt lõi bạn cần hiểu sâu sắc để xây dựng các ứng dụng trên AngularJS - Chúng tôi sẽ xây dựng một ứng dụng trang duy nhất xuyên suốt lộ trình của khóa học.','90000000','https://static.edumall.vn/uploads/images/courses/thumbnail_nbv01_570x345.png',NULL,'https://edumall.vn/courses/nghien-cuu-va-tim-hieu-angular-js/detail','edumall.vn','899,000đ\nƯu đãi 66% chỉ còn :\n299,000đ\n02\nngày : 03\ngiờ : 23\nphút : 29\ngiây',100),(2,'Thiết kế Website siêu tốc trong 30 phút bằng các công cụ','Đặng Ngọc Bình','Website là cách hiệu quả nhất để đưa thông tin và thuyết phục khách hàng mua sản phẩm của bạn.\nTuy nhiên, thuê người làm 1 website tại Việt Nam sẽ tốn từ 500,000 đến 3,000,000 đồng, chi phí này còn phụ thuộc vào độ phức tạp mà bạn mong muốn cho trang web của bạn.\nĐến với khóa học này, bạn sẽ biết cách sử dụng các công cụ siêu tốc phổ biến để thiết kế ra một trong web dễ dàng, chỉ trong 30 phút!\nNgoài ra, khóa học đem đến cho các bạn những kiến thức về Wordpress - một công cụ quyền năng dùng để tạo ra trang web riêng mang phong cách của bạn!\nĐặc biệt: Tặng miễn phí theme Sahifa sử dụng trong suốt khóa học trị giá $59.99','94000030','https://static.edumall.vn/uploads/images/courses/thumbnail_dnb01_570x3adasd45.png',NULL,'https://edumall.vn/courses/tu-tao-website-trong-30-phut-bang-cac-cong-cu-sieu-toc/detail','edumall.vn','499,000đ\nƯu đãi 40% chỉ còn :\n299,000đ\n02\nngày : 03\ngiờ : 23\nphút : 36\ngiây',20),(3,'Tự Xây Dựng 10 Trang Web Chỉ Trong 6 Tuần','Phạm Quang Vinh','Trong một thế giới mà công nghệ thông tin đang ngày càng trở nên quan trọng, hẳn bạn đã từng trầm trồ trước những nhà lập trình khi họ có thể dễ dàng lập trình nên những trang web đầy tiện ích mà bạn vẫn sử dụng hằng ngày. Vậy bạn có biết rằng, chính bạn cũng có thể lập trình được những trang web như vậy với một vốn kiến thức cơ bản về HTML, CSS, ... Dù bạn là những nhà thiết kế web, những nhà lập trình mới bắt đầu hay bất kỳ ai muốn phát triển nghề nghiệp trong tương lai, thăng tiến trong công việc thì xây dựng được một website là điều kiện tiên quyết cho những mục tiêu trên. Việc học lập trình sẽ giúp bạn nâng cao kĩ năng và điều đó có ích cho cá nhân lẫn công việc, nhưng không hẳn ai cũng biết phải bắt đầu xây dựng website đầu tiên như thế nào.','90000000','https://static.edumall.vn/uploads/images/courses/thumbnail_570asdasdsadsad.jpg',NULL,'https://edumall.vn/courses/tu-xay-dung-14-trang-web-chi-trong-6-tuan/detail','edumall.vn','599,000đ\nƯu đãi 50% chỉ còn :\n299,000đ\n02\nngày : 03\ngiờ : 23\nphút : 22\ngiây',0),(4,'Lập trình ứng dụng di động - Tự học và xây dựng 10 ứng dụng IOS với SWIFT','Phạm Thanh Chí','Trong báo cáo tháng 1/2016 của State of Mobile App Developers, kết quả cho thấy: Có đến 86% lập trình viên được hỏi đã viết ứng dụng cho Android, 56% viết cho iOS. Mức thu nhập của lập trình viên Android vào khoảng 4.900 USD/tháng nhưng các \"đồng nghiệp\" bên IOS lại thu nhập 8.100 USD/tháng.','90000000','https://static.edumall.vn/uploads/images/courses/thumbnail_230balala.jpg',NULL,'https://edumall.vn/courses/lap-trinh-ung-dung-di-dong-tu-hoc-va-xay-dung-10-ung-dung-ios-voi-swift/detail','edumall.vn','499,000đ\nƯu đãi 60% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 22\nphút : 57\ngiây',1),(5,'Lập trình ứng dụng Android trong 6 tuần','Trần Duy Thanh','Chào mừng bạn đến với khoá học:\"Lập trình ứng dụng Android trong 6 tuần\"!\nKhóa học cung cấp trọn bộ kiến thức từ cơ bản đến nâng cao của lập trình Java cũng như lập trình Android giúp học viên có thể tạo ra một ứng dụng Android hoàn chỉnh sau khi hoàn thành khóa học. Bên canh đó, khóa học cũng sẽ cung cấp những cơ hội thực hành tạo ứng dụng Android ngay trong quá trình học. Sau khi hoàn thành khóa học, có thể kiếm tiền từ Google Play nhờ các ứng dụng tự tạo. Khóa họ̣c sử dụng những công cụ, Framework mới nhất.','90000000','https://static.edumall.vn/uploads/images/courses/thumbnail_abababa.jpg',NULL,'https://edumall.vn/courses/lap-trinh-android-tu-co-ban-den-nang-cao/detail','edumall.vn','599,000đ\nƯu đãi 50% chỉ còn :\n299,000đ\n02\nngày : 03\ngiờ : 23\nphút : 15\ngiây',0),(6,'Nhập môn lập trình Web','Đặng Minh Tuấn','Bạn là người mới và muốn bước đầu tìm hiểu về lập trình web?\nBạn muốn tự xây dựng trang web cho sản phẩm của mình?','90000000','https://static.edumall.vn/uploads/images/courses/thumbnail_nhap-mon-lap-trinh-web-01.png',NULL,'https://edumall.vn/courses/nhap-mon-lap-trinh-web/detail','edumall.vn','99,000đ',0),(7,'Lập trình android cơ bản qua ứng dụng tra cứu giao thông','Vi Thành Kiên','Android là hệ điều hành được sử dụng phổ biến nhất trên toàn cầu, chiếm khoảng 80% smartphone.\nLập trình Android đang trở thành một sự lựa chọn tuyệt vời trong hành trình phát triển ứng dụng trên điện thoại di động với 1 tỷ người sử dụng, 1.5 triệu thiết bị mới được kích hoạt mỗi ngày.\nSự phát triển của thiết bị Android tạo ra nhiều cơ hội lớn cho doanh số bán ứng dụng và thị trường ứng dụng di động cho Android cũng được phát triển.','90000000','https://static.edumall.vn/uploads/images/courses/thumbnail_androidxxxx.jpg',NULL,'https://edumall.vn/courses/laptrinhandroidcoban/detail','edumall.vn','499,000đ\nƯu đãi 60% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 22\nphút : 23\ngiây',0),(8,'Làm trang web của riêng bạn với HTML, CSS & Javascript','Đặng Minh Tuấn','Hiện nay, lập trình nói chung & lập trình Web nói riêng đang là xu hướng được nhiều bạn trẻ quan tâm. Với kinh nghiệm 5 năm giảng dạy về lập trình Web, tôi tự tin mang đến cho các bạn khóa học \"Xây dựng trang web của riêng bạn với HTML, CSS & Javascript\", nơi tập hợp nhiều kinh nghiệm quý giá tôi đã đúc kết được trong suốt quá trình làm việc với bộ công cụ tuyệt vời này:\n ','90000000','https://static.edumall.vn/uploads/images/courses/thumbnail_thumbnail_dmt01_570x345.png',NULL,'https://edumall.vn/courses/lap-trinh-web-html---css-tu-dau/detail','edumall.vn','599,000đ\nƯu đãi 50% chỉ còn :\n299,000đ\n02\nngày : 03\ngiờ : 22\nphút : 39\ngiây',0),(9,'Làm Website đơn giản thôi mà!','Phạm Hùng Thắng','Bạn tò mò về cách tạo ra những trang web có giao diện đẹp mắt, nhiều người truy cập mà bạn vẫn thường vào mỗi ngày? Bạn kinh doanh và muốn tạo ra một trang web để đăng tải thông tin sản phẩm của mình nhưng lại chẳng biết gì về lập trình web? Khóa học \"Học làm web đơn giản thôi mà\" là khóa học bổ ích cung cấp cho bạn những kiến thức nền tảng cần thiết nhất về Internet, làm Web, các loại ngôn ngữ lập trình (HTML, CSS, JS), giới thiệu đến bạn những công cụ phổ biến cũng như những công nghệ làm web mới nhất.','94000030','https://static.edumall.vn/uploads/images/courses/thumbnail_pht01_570x345.png',NULL,'https://edumall.vn/courses/lap-trinh-web-cho-nguoi-moi-bat-dau/detail','edumall.vn','699,000đ\nƯu đãi 57% chỉ còn :\n299,000đ\n02\nngày : 03\ngiờ : 22\nphút : 52\ngiây',0),(10,'Lập trình PHP từ cơ bản đến nâng cao trong 6 tuần - Thực hành tự tạo website tin tức','Phạm Hồng Phong','Bạn có biết hơn 80% website hiện nay đều được viết bằng ngôn ngữ PHP\nBạn cũng muốn tự mình làm nên 1 website hoàn chỉnh, tương tác cao với người dùng, vậy chắc chắn bạn cần thành thạo PHP rồi. Với nền tảng HTML, CSS đã có, tôi tin rằng bạn sẽ dễ dàng làm chủ ngôn ngữ lập trình tuyệt vời này. Tôi sẽ giúp các bạn tất cả những gì cần biết về PHP để tạo nên một website hoàn chỉnh.','90000000','https://static.edumall.vn/uploads/images/courses/thumbnail_570thethethe.jpg',NULL,'https://edumall.vn/courses/lap-trinh-php-co-ban-den-nang-cao/detail','edumall.vn','699,000đ\nƯu đãi 57% chỉ còn :\n299,000đ\n02\nngày : 03\ngiờ : 22\nphút : 28\ngiây',88),(11,'Xây dựng Single-Page Web App với AngularJS Routing','Phan Văn Luân','Các ứng dụng Single Page ngày càng trở nên phổ biến. Khi ứng dụng của chúng ta lớn dần, việc đặt tất cả các views vào trong một file sẽ khiến chúng ta rất khó quản lý. Việc chia nhỏ chúng vào trong Views và sử dụng Routing để tải các phần khác nhau của ứng dụng giúp chúng ta phân chia ứng dụng hợp lý và quản lý dễ dàng hơn. Bạn code web nhẹ nhành nhưng hiệu quả hơn nhiều so với phương pháp lập trình web truyền thống','90000000','https://static.edumall.vn/uploads/images/courses/thumbnail_angularjs.jpg',NULL,'https://edumall.vn/courses/single-page-web-app-voi-angularjs-routing/detail','edumall.vn','599,000đ',0),(12,'Học thiết kế Website động với ASP.NET WebForm và SQL Server','Trương Minh Tuấn','Trung bình mỗi giây lại có 1 website đăng ký mới ra đời, tính đến nay đã có hơn 1 tỷ website trên thế giới. Mỗi website lại có những đặc trưng riêng, những hình thức thể hiện và tính chất tương tác với người dùng khác nhau. Tuy nhiên tất cả chúng đều được xây dựng trên nền tảng là các ngôn ngữ lập trình web.','90000000','https://static.edumall.vn/uploads/images/courses/thumbnail_tuantm.01.570-x-345.png',NULL,'https://edumall.vn/courses/website-dong-voi-aspnet-webform-sql-server/detail','edumall.vn','1,299,000đ\nƯu đãi 69% chỉ còn :\n399,000đ\n02\nngày : 03\ngiờ : 22\nphút : 08\ngiây',0),(13,'Một giờ học Javascript','Phan Văn Luân','Nếu như vài năm trước đây JavaScript chỉ là một ngôn ngữ lập trình ít người quan tâm thì gần đây cùng với sự phát triển mạnh mẽ của HTML5, Boostrap, NodeJs đã biến JavaScript thành một trong 2 ngôn ngữ lập trình, thiết kế web quan trọng nhất. Do vậy, nắm rõ về JavaScript sẽ giúp bạn có lợi thế lớn trong công việc.\nHiểu được nhu cầu tìm hiểu về JavaScript ngày càng lớn hiện nay, tôi cùng Edumall đã hợp tác sản suất khóa học \"Một giờ học JavaScript\" nhằm giúp các bạn nắm được kiến thức và lập trình được các chương trình cơ bản chỉ trong 1 giờ.','90000000','https://static.edumall.vn/uploads/images/courses/thumbnail_javava.jpg',NULL,'https://edumall.vn/courses/mot-gio-hoc-javascript/detail','edumall.vn','599,000đ\nƯu đãi 66% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 22\nphút : 17\ngiây',0),(14,'Tìm hiểu về dự án mã nguồn mở','Topica Uni','Nhằm đáp ứng nhu cầu hiện tại và xu hướng công nghệ toàn cầu, nắm bắt tình hình với mục tiêu đào tạo những gì doanh nghiệp cần, Edumall đã đưa khóa học \"Dự án mã nguồn mở\" vào chương trình đào tạo. Khóa học \"Dự án mã nguồn mở\" này sẽ cung cấp cho học viên những kiến thức cơ bản nhất về mã nguồn mở, xây dựng phần mềm mã nguồn mở, lập trình web với PHP và làm việc với hệ quản trị cơ sở dữ liệu MySQL, cách khai thác và ứng dụng phần mềm mã nguồn mở trong xây dựng hệ thống cơ sở dữ liệu cho doanh nghiệp.','93000000','https://static.edumall.vn/uploads/images/courses/thumbnail_65416854632135.jpg',NULL,'https://edumall.vn/courses/du-an-ma-nguon-mo/detail','edumall.vn','399,000đ\nƯu đãi 50% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 21\nphút : 57\ngiây',0),(15,'Thiết kế Web với Photoshop và cách kiếm tiền từ công việc Freelance','Nguyễn Đức Việt','Trong 24h, trên internet có hàng trăm ngàn website được tạo ra cũng như có hàng trăm ngàn website bị đào thải. Vậy, để trang web đứng vững trong thị trường rộng mở hiện nay, bên cạnh tính tiện dụng thì thiết kế đẹp và hút mắt cũng đóng vai trò cực kỳ quan trọng. Cũng chính nhờ nhu cầu lớn và tính cạnh tranh mạnh mẽ này mà nghề web designer đang trở thành một trong những ngành nghề hot và hái ra tiền ở Việt Nam.\nBạn là một người trẻ muốn học hỏi, trau dồi kỹ năng?\nBạn làm trong các lĩnh vực Marketing, Thiết kế hay lập trình? \nBạn muốn tăng thu nhập của mình nhờ kỹ năng thiết kế web?','85000040','https://static.edumall.vn/uploads/images/courses/thumbnail_ndv01_570x345.png',NULL,'https://edumall.vn/courses/thietkewebvoiphotoshopvacachkiem-tien-tu-cong-viec-freelance/detail','edumall.vn','599,000đ\nƯu đãi 50% chỉ còn :\n299,000đ\n02\nngày : 03\ngiờ : 22\nphút : 02\ngiây',0),(16,'Cấu trúc dữ liệu và giải thuật','Topica Uni','Khoá học cung cấp các kiến thức cơ bản về cấu trúc dữ liệu và giải thuật, chi tiết về các cấu trúc dữ liệu cụ thể (danh sách, ngăn xếp, hàng đợi, cây) và các giải thuật quan trọng là tìm kiếm và sắp xếp.','90000000','https://static.edumall.vn/uploads/images/courses/thumbnail_course_image_avar--cau-truc-va-giai-thuat.jpg',NULL,'https://edumall.vn/courses/cau-truc-du-lieu-va-giai-thuat/detail','edumall.vn','549,000đ\nƯu đãi 63% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 21\nphút : 51\ngiây',0),(17,'Nhập môn Internet và E-Learning','Topica Uni','Ngày nay Internet trở nên gần gũi và quen thuộc với hàng triệu người ở Việt Nam, đặc biệt ở khu vực thành thị, trong giới tri thức và giới trẻ. Sự tồn tại của Internet đã thay đởi cách thức làm việc, trao đổi thông tin, kể kả học tập và nghiên cứu của nhiều người.\nKhoá học \"Nhập môn Internet và E-Learing\" sẽ giúp bạn trang bị những kiến thức và kỹ năng cơ bản nhất về Internet và E-learning. Hiểu được các phương pháp, quy trình học E-Learning và biết cách sử dụng công cụ trong E-Learing.','66050005','https://static.edumall.vn/uploads/images/courses/thumbnail_inininin.jpg',NULL,'https://edumall.vn/courses/nhap-mon-internet-va-e-learning/detail','edumall.vn','299,000đ\nƯu đãi 33% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 21\nphút : 40\ngiây',0),(18,'Làm thế nào để chữa bệnh chậm nói ở trẻ?','Nguyễn Minh Đức','Khoa học đã chứng minh rằng việc phát triển khả năng ngôn ngữ và giao tiếp gây ảnh hưởng trực tiếp đến trí thông minh của trẻ. Tuy nhiên, có một điều đáng báo động là có đến 45% bệnh nhi đến điều trị tại Bệnh viện nhi đồng 1 - Tp.HCM có liên quan đến việc chậm phát triển ngôn ngữ, đặc biệt là chậm nói.\nNhiều cha mẹ cũng đã bày tỏ với các chuyên gia của chúng tôi rằng họ rất lo lắng khi con của mình 2 tuổi rồi mà vẫn chưa giao tiếp được như \"con nhà người ta.\" Chậm nói là một \"bài toán khó\" đối với các bậc phụ huynh và các nhà hoạt động giáo dục bởi nó ngày càng phổ biến và gia tăng về số lượng.','00048800','https://static.edumall.vn/uploads/images/courses/thumbnail_nmd02_570x345.1.png',NULL,'https://edumall.vn/courses/lam-the-nao-de-chua-benh-cham-noi-o-tre/detail','edumall.vn','499,000đ\nƯu đãi 60% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 21\nphút : 21\ngiây',0),(20,'Thủ thuật và bí quyết thiết kế đồ họa game di động dành cho dân nghiệp dư','Sắp ra mắt','Khóa học Thủ thuật và bí quyết thiết kế đồ họa game di động dành cho dân nghiệp dư sẽ chia sẻ với các bạn về những lời khuyên và thủ thuật về làm đồ họa game khi bạn chỉ là dân nghiệp dư trong ngành đồ họa!\nVới các thủ thuật và bí quyết thiết kế đồ họa game di động từ giảng viên, bạn sẽ nhanh chóng hiểu rằng: Tất cả bạn cần là tham gia khoá này','70000060','https://static.edumall.vn/uploads/images/courses/thumbnail_ad.jpg',NULL,'https://edumall.vn/courses/thu-thuat-va-bi-quyet-thiet-ke-do-hoa-game-di-dong-danh-cho-dan-nghiep-du/detail','edumall.vn','',0),(21,'Phương pháp giải mã tám loại khó khăn tâm lý thường gặp ở trẻ','Nguyễn Minh Đức','Mô tả về khóa học\nCó bao giờ bạn cảm thấy hụt hẫng và băn khoăn vì những thiếu hụt chậm trễ trong sự phát triển của con mình?\nCó bao giờ bạn cảm thấy vướng bận nhưng chưa thể gọi tên chính xác những khó khăn của con mình?','00048800','https://static.edumall.vn/uploads/images/courses/thumbnail_gia-ma-tam-loai-8-ly-cua-tre.jpg',NULL,'https://edumall.vn/courses/phuong-phap-giai-ma-tam-loai-kho-khan-tam-ly-thuong-gap-o-tre/detail','edumall.vn','499,000đ\nƯu đãi 60% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 21\nphút : 14\ngiây',0),(25,'Bảo vệ con trước những nguy cơ từ 3 loại thiết bị công nghệ phổ biến','Nguyễn Minh Đức','Chậm phát triển