oads/images/courses/thumbnail_thethethethe.jpg',NULL,'https://edumall.vn/courses/tuyet-chieu-viet-cv/detail','edumall.vn','399,000đ\nƯu đãi 50% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 19\nphút : 33\ngiây',0),(28,'Làm chủ giọng nói để thành công hơn trong công việc','Phan Phúc Thắng','Cuộc sống hàng ngày đòi hỏi mỗi người chúng ta phải giao tiếp với rất nhiều mối quan hệ & đối tượng khác nhau. Trong đó, giọng nói chính là phương tiện giao tiếp số một.\nĐã bao giờ bạn lạc giọng khi trả lời phỏng vấn chỉ vì quá hồi hộp và hụt hơi?\nĐã bao giờ bạn thất bại khi nêu ý tưởng chỉ vì giọng nói quá khó nghe và không ai hiểu?\nĐã bao giờ bạn bị khách hàng từ chối chỉ vì bạn nói quá nhanh hay cách nói không thu hút người đối diện?','05090000','https://static.edumall.vn/uploads/images/courses/thumbnail_ppt01-1_570x345xxxxxxx.png',NULL,'https://edumall.vn/courses/lam-chu-giong-noi-de-thanh-cong-hon-trong-cong-viec/detail','edumall.vn','699,000đ\nƯu đãi 57% chỉ còn :\n299,000đ\n02\nngày : 03\ngiờ : 20\nphút : 31\ngiây',0),(29,'Bí kíp quản trị thời gian để tăng hiệu quả học tập và làm việc','Nguyễn Vĩnh Bảo','Bạn từng chậm deadline, làm việc không hiệu quả, stress vì công việc ngập đầu và không thể tập trung? Nếu câu trả lời là có thì đây là lúc bạn nên nhìn lại chiến lược quản trị thời gian của chính mình.','04090400','https://static.edumall.vn/uploads/images/courses/thumbnail_14.ky-nang-quan-ly-thoi-gian-hieu-qua-cho-sinh-vien.jpg',NULL,'https://edumall.vn/courses/bi-kip-quan-tri-thoi-gian-de-tang-hieu-qua-hoc-tap-va-lam-viec/detail','edumall.vn','399,000đ\nƯu đãi 50% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 20\nphút : 05\ngiây',0),(30,'Tiến sĩ Lê Thẩm Dương tiết lộ bí quyết giao tiếp để thành công','Lê Thẩm Dương','Thất bại? Bất công?\nBạn mệt mỏi tự hỏi tại sao bản thân đã cố gắng rất nhiều mà không được những người xung quanh yêu quý, không thể tìm được một công việc tốt?','04090000','https://static.edumall.vn/uploads/images/courses/thumbnail_ltd01_570x345.png',NULL,'https: