ạp. ','09030000','https://static.edumall.vn/uploads/images/courses/thumbnail_hr-k-k-k-k-k-.jpg',NULL,'https://edumall.vn/courses/quan-tri-nhan-su/detail','edumall.vn','299,000đ\nƯu đãi 33% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 17\nphút : 53\ngiây',0),(35,'Dinh dưỡng cho trẻ sơ sinh','Sắp ra mắt','Những ông bố, bà mẹ chắc hẳn sẽ có nhiều câu hỏi hoặc những lúc đắn đo nên cho bé yêu của mình ăn gì và ăn như thế nào? Ngay từ khi sinh ra, thì sữa mẹ là nguồn hạnh phúc cho bé yêu, nhưng đến thời điểm bé yêu lớn dần thì nhu cầu dinh dưỡng sẽ cần nhiều hơn thế. Chúng ta có thể nhận thấy được nhu cầu dinh dưỡng của con mình thay đổi theo độ tuổi và sự tò mò muốn khám phá những loại đồ ăn mới. Sẽ rất tốt nếu bạn nắm được những đánh giá tin cậy và gắn với thực tế để quyết định chọn loại thức ăn nào phù hợp với con bạn.','00009800','https://static.edumall.vn/uploads/images/courses/thumbnail_cs.06_570x345.png',NULL,'https://edumall.vn/courses/dinh-duong-cho-tre-so-sinh/detail','edumall.vn','',0),(36,'36 Tuyệt chiêu để trở thành người bán hàng số một','Nguyễn Vĩnh Cường','Mô tả về khóa học\nRất nhiều người đã thành công khi bán hàng, họ đẩy cao doanh số và có nguồn thu nhập lớn\nBạn cũng kinh doanh\nBạn cũng bán hàng\nTại sao bạn không thành công như họ?\nBạn tìm lời giải đáp trong các cuốn sách mà chưa hài lòng. Sau mọi cố gắng mà không kết quả, bạn cho rằng : Mình không có \"duyên bán hàng\" và muốn từ bỏ công việc này...\nĐừng vội vàng như vậy!\nNếu bạn có trong tay những tuyệt chêu - thứ quý giá của những người bán hàng thành công, bạn sẽ thấy việc này đơn giản hơn rất nhiều.','09000000','https://static.edumall.vn/uploads/images/courses/thumbnail_nvc01_570x345.png',NULL,'https://edumall.vn/courses/tuyet-chieu-ban-hang-so-mot/detail','edumall.vn','449,000đ\nƯu đãi 55% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 19\nphút : 04\ngiây',0),(37,'Các vấn đề pháp lý trong khởi nghiệp','TFI','Khởi nghiệp hay Startup là một hoạt động rất phổ biến trên thế giới nhưng khá mới mẻ ở Việt Nam và không phải ai cũng hiểu rõ các điều luật liên quan đến vấn đề khởi nghiệp cũng như biết nên bắt đầu từ đâu.\n ','09000000','https://static.edumall.vn/uploads/images/courses/thumbnail_the-the-the.jpg',NULL,'https://edumall.vn/courses/cac-van-de-phap-ly-trong-khoi-nghiep/detail','edumall.vn','Miễn phí',0),(38,'20 Thay đổi giúp bạn thành công và giàu có','Nguyễn Vĩnh Cường','\"Cuộc sống luôn luôn vận động - Sự vận động tạo ra CƠ HỘI - Bạn có sẵn sàng nắm bắt cơ hội của mình?\"\n\"Nếu muốn có những gì chưa từng có, bạn hãy làm những điều chưa từng làm.\"','08080000','https://static.edumall.vn/uploads/images/courses/thumbnail_17.20-thay-doi-giup-ban-thanh-cong-va-giau-co.jpg',NULL,'https://edumall.vn/courses/20-thay-doi-giup-ban-thanh-cong-va-giau-co/detail','edumall.vn','549,000đ\nƯu đãi 63% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 18\nphút : 53\ngiây',0),(39,'Tự triển khai kinh doanh online','Vương Mạnh Hoàng','Bạn là nhân viên kinh doanh hoặc bạn có sản phẩm dịch vụ và muốn mở rộng công việc kinh doanh của mình hay đơn giản bạn muốn làm gì đó để tăng thêm thu nhập cho bản thân thì hãy tiếp cận với kinh doanh online để phát triển sự nghiệp tương lai của bạn\n\nHiểu được điều đó, tôi đã cùng Edumall thực hiện khóa học \"Tự triển khai kinh doanh online\" dựa trên phương thức giảng dạy \"Coaching\" theo các mô hình thành công kết hợp với việc sử dụng lí thuyết và thực hành trực quan. Tôi mong rằng sẽ giúp các bạn hiểu được để tiến hành kinh doanh trên internet phải chuẩn bị những gì, chọn sản phẩm dịch vụ ra sao và để đạt được hiệu quả lâu dài thì sẽ phải làm gì.','39000000','https://static.edumall.vn/uploads/images/courses/thumbnail_tu-trien-khai-kinh-doanh-online-01.png',NULL,'https://edumall.vn/courses/tu-trien-khai-kinh-doanh-online/detail','edumall.vn','349,000đ\nƯu đãi 42% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 17\nphút : 36\ngiây',0),(40,'Làm thế nào để có thể kiếm tiền từ Youtube','Ninh Đôn','Công việc văn phòng nhàm chán, hay đơn giản bạn muốn một trải nghiệm giúp mình có thêm một khoản thu nhập ngoài lương?\nBạn đã từng kiếm tiền online và muốn phát triển Youtube thành một kênh kiếm tiền khác của mình?\nVậy khóa học \"Làm thế nào để có thể kiếm tiền từ Youtube\" này chính là dành cho bạn! \n ','58000000','https://static.edumall.vn/uploads/images/courses/thumbnail_youtube-app.jpg',NULL,'https://edumall.vn/courses/kiem-2000--moi-thang-tren-youtube/detail','edumall.vn','499,000đ\nƯu đãi 60% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 17\nphút : 42\ngiây',0),(41,'Đội nhóm và cố vấn','TFI','Bạn gặp vấn đề nhức nhối liên quan đến nhân sự?\nBạn không tạo được văn hóa làm việc tốt trong công ty, nhân sự của bạn ngày càng giảm và hiệu quả công việc giảm sút đáng kể?','09040000','https://static.edumall.vn/uploads/images/courses/thumbnail_team.jpg',NULL,'https://edumall.vn/courses/doi-nhom-va-co-van/detail','edumall.vn','Miễn phí',0),(44,'Kỹ năng đàm phán và thương lượng trong kinh doanh','Phan Thanh Bình','Để đạt được thành công trong cuộc sống cũng như công việc, ngoài tài năng và đôi chút may mắn thì một yếu tố quan trọng không thể thiếu đó chính là kỹ năng đàm phán và thương lượng. Bạn thấy mình thiếu tự tin, không biết cách thuyết phục và thương lượng? Bạn không biết phải bắt đầu từ đâu và giải quyết các tình huống gặp phải khi đàm phán và thương lượng trong kinh doanh?\n-------------------','09040000','https://static.edumall.vn/uploads/images/courses/thumbnail_ptt01_570x345.png',NULL,'https://edumall.vn/courses/ky-nang-dam-phan-va-thuong-luong-trong-kinh-doanh/detail','edumall.vn','349,000đ\nƯu đãi 14% chỉ còn :\n299,000đ\n02\nngày : 03\ngiờ : 16\nphút : 42\ngiây',0),(45,'Bán hàng và giao dịch trong khởi nghiệp','TFI','Bạn thực sự hiểu được tầm quan trọng của bán hàng và giao dịch?\n\nKhông chỉ riêng với Startup mà còn cả các công ty đã và đang phát triển bền vững thì Telesale và Telemarketing luôn luôn là quan trọng cấp thiết. Hiểu được điều đó, tôi đã cùng với Edumall xây dựng khóa học \"Bán hàng và giao dịch trong khởi nghiệp\" để giúp bạn và công ty của bạn có những bước tiến phát triển.','09000000','https://static.edumall.vn/uploads/images/courses/thumbnail_istock_000047993668_large.jpg',NULL,'https://edumall.vn/courses/ban-hang-va-giao-dich-trong-khoi-nghiep/detail','edumall.vn','Miễn phí',0),(46,'Tự tin phân tích báo cáo tài chính','Topica Uni','Bạn là nhà đầu tư nghiệp dư đang băn khoăn trước báo cáo kết quả kinh doanh?\nBạn bối rối khi xem một bảng cân đối kế toán?\nBạn cảm thấy các chỉ số ROE, ROA tối nghĩa và khó hiểu?\nBạn muốn biết doanh nghiệp có thực sự làm tốt như mình vẫn nghĩ?','09000000','https://static.edumall.vn/uploads/images/courses/thumbnail_tai-chinhxx.jpg',NULL,'https://edumall.vn/courses/phan-tich-bao-cao-tai-chinh/detail','edumall.vn','299,000đ\nƯu đãi 33% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 16\nphút : 29\ngiây',0),(48,'Luật ngân hàng','Topica Uni','Bạn là người đam mê tìm hiểu kiến thức về luật đặc biệt là luật ngân hàng Bạn mong muốn tham gia vào các hoạt động giao dịch với ngân hàng và các tổ chức tài chính Bạn đang tìm kiếm một khóa học với đầy đủ nội dung liên quan đến lĩnh vực luật ngân hàng với các bài giảng sinh động , ứng dụng thực tiễn cao','09000000','https://static.edumall.vn/uploads/images/courses/thumbnail_thua-ke-theo-phap-luat.jpg',NULL,'https://edumall.vn/courses/luat-ngan-hang/detail','edumall.vn','399,000đ\nƯu đãi 50% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 15\nphút : 57\ngiây',0),(49,'Xây dựng và phát triển sản phẩm','TFI','Những người muốn khởi nghiệp đều mất rất nhiều thời gian vào việc lên kế hoạch xây dựng và phát triển sản phẩm nhưng không phải ai cũng dễ dàng với nó. Việc xây dựng và phát triển sản phẩm không hề dễ như tên của nó. Việc tìm kiếm ra được một sản phẩm cho công việc của bạn đã khó nhưng làm sao để phát triển sản phẩm đó lên lại càng khó hơn.','09000000','https://static.edumall.vn/uploads/images/courses/thumbnail_product_lg_type.jpg',NULL,'https://edumall.vn/courses/xay-dung-va-phat-trien-san-pham/detail','edumall.vn','Miễn phí',0),(50,'Guitar đệm hát trong 30 ngày','Nguyễn Thượng Hiển','Thực tế cho thấy những người có khả năng chơi một loại nhạc cụ nào đó thì luôn biết cách làm mình nổi bật giữa đám đông và vô cùng tự tin. Vậy tại sao bạn không chọn một loại nhạc cụ và bắt đầu luyện tập ngay từ bây giờ? Hãy đến với khoá học \"Guitar đệm hát trong 30 ngày\" của tôi, bạn sẽ làm chủ được cây đàn guitar trong tay và nghêu ngao hát cùng bạn bè.','00000090','https://static.edumall.vn/uploads/images/courses/thumbnail_nth01_570345.jpg',NULL,'https://edumall.vn/courses/guitar-dem-hat-trong-30-ngay/detail','edumall.vn','699,000đ\nƯu đãi 57% chỉ còn :\n299,000đ\n02\nngày : 03\ngiờ : 18\nphút : 45\ngiây',0),(52,'Nghiên cứu và phát triển thị trường','TFI','Trong lĩnh vực kinh doanh, nghiên cứu và phát triển thị trường luôn là một trong những nhiệm vụ quan trọng nhất. Tuy nhiên, làm thế nào cho đúng, làm thế nào để vừa tiết kiệm chi phí vừa thu được lợi nhuận tối đa thì không phải ai cũng biết.','09000000','https://static.edumall.vn/uploads/images/courses/thumbnail_5-pham-chat-can-co-de-khoi-nghiep-thanh-cong1.jpg',NULL,'https://edumall.vn/courses/nghien-cuu-va-phat-trien-thi-truong/detail','edumall.vn','Miễn phí',0),(53,'Sử dụng thành thạo Excel Pivot cho người mới bắt đầu','Nguyễn Thanh Tùng','Bạn có thể là người mới bắt đầu với Excel và chưa có khái niệm gì về Excel Pivot. Hay bạn là một người đã biết qua Excel cũng như Excel Pivot và muốn tìm hiểu sâu hơn về chức năng này, thì khóa học \"Sử dụng thành thạo Excel Pivot cho người mới bắt đầu\" sẽ giúp bạn điều này. \nChỉ trong 6h55p, bạn sẽ cùng tôi học cách tổng hợp một báo cáo chuyên nghiệp từ nhiều nguồn dữ liệu. Chúng ta cũng sẽ kết hợp Excel Pivot với các chức năng khác, như: conditional formatting, slicer... để tạo ra một bảng biểu báo cáo đẹp, gây ấn tượng với cấp quản lý.','30000009','https://static.edumall.vn/uploads/images/courses/thumbnail_exxxxx.jpg',NULL,'https://edumall.vn/courses/su-dung-thanh-thao-excel-pivot-cho-nguoi-moi-bat-dau/detail','edumall.vn','499,000đ\nƯu đãi 60% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 18\nphút : 34\ngiây',0),(54,'Luật cạnh tranh','Topica Uni','Tổ chức kinh doanh của bạn đang gặp vấn đề về bảo hộ kinh doanh, khó khăn khi thâm nhập thị trường hay hội nhập thị trường quốc tế. Bạn không biết luật nào thực sự hữu ích và cần thiết để giải quyết vấn đề này?','09000000','https://static.edumall.vn/uploads/images/courses/thumbnail_uni22_570x345.png',NULL,'https://edumall.vn/courses/luat-canh-tranh/detail','edumall.vn','299,000đ',0),(55,'Bí quyết thành công trong khởi nghiệp kinh doanh online','Thạc sĩ Johnny Thông','Bạn có ý tưởng muốn kinh doanh online, bạn chưa biết bắt đầu từ đâu? Bạn nghĩ rằng việc thành lập và điều hành một doanh nghiệp theo mô hình kinh doanh online không được bền lâu? Bạn không tự tin vào khả năng bán hàng của mình? Bạn không biết sử dụng những công cụ nào để có thể kinh doanh một cách hiệu quả?\nVới khóa học này tôi sẽ giúp bạn giải đáp hết những thắc mắc, những vấn đề bạn đang gặp phải. Qua nhiều năm hoạt động và gặt hái được nhiều thành công trong lĩnh vực kinh doanh online, tôi sẽ hướng dẫn bạn các công cụ hữu ích trong việc kinh doanh online và kết hợp với các công cụ là những chiến lược kinh doanh đi cùng để có thể tăng hiệu quả lên rất rất nhiều lần.','39000000','https://static.edumall.vn/uploads/images/courses/thumbnail_ci---khoi-nghiep-online-business-thanh-cong.jpg',NULL,'https://edumall.vn/courses/bi-quyet-thanh-cong-trong-khoi-nghiep-kinh-doanh-online/detail','edumall.vn','Miễn phí',0),(56,'Trọn bộ kiến thức trong \"Kế toán công ty\"','Topica Uni','Tất cả những thông tin về kinh tế, tài chính đều phải được qua bộ phận kế toán phân tích, xử lý. Thông qua bộ phận kế toán, những nhà quản lý có thể theo dõi được tình hình sản xuất kinh doanh của doanh nghiệp mình, diễn biến của thị trường... Từ đó có cơ sở để đưa ra những đánh giá và hướng đi cho doanh nghiệp.','09000000','https://static.edumall.vn/uploads/images/courses/thumbnail_ke-toan-cong-ty.jpg',NULL,'https://edumall.vn/courses/ke-toan-cong-ty/detail','edumall.vn','299,000đ\nƯu đãi 33% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 16\nphút : 05\ngiây',0),(57,'Kế toán trong các doanh nghiệp','Topica Uni','Hoạt động kế toán có thể nói là một trong những hoạt động quan trọng nhất đối với các doanh nghiệp. Thông qua hoạt động kế toán, nhà quản lý có thể nắm bắt được tình hình sản xuất kinh doanh của doanh nghiệp cũng như diễn biến của thị trường.','09000000','https://static.edumall.vn/uploads/images/courses/thumbnail_ke-toan.jpg',NULL,'https://edumall.vn/courses/ke-toan-trong-cac-doanh-nghiep/detail','edumall.vn','299,000đ\nƯu đãi 33% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 16\nphút : 11\ngiây',0),(58,'Kỹ năng gây ảnh hưởng và thuyết phục trong các hành vi bán hàng','Nguyễn Minh Ngọc','Bạn có thấy rằng có khi cùng một mặt hàng nhưng đôi khi bạn thuyết phục rất tốt nhưng cũng có khi lại rất kém.\nHay như khi vào cùng một công ty, cùng một cách đào tạo, cùng một người đào tạo, cùng bán một sản phẩm nhưng có người thì bán hàng rất tốt, nhưng có người lại chẳng thể bán được.\nSau một thời gian dài nghiên cứu về hành vi thuyết phục, thầy Nguyễn Minh Ngọc đã thấy rằng nội dung tốt chỉ chiếm 10% để tạo nên tính thuyết phục. Vậy yếu tố chiếm tới 90% còn lại là gì?','09040000','https://static.edumall.vn/uploads/images/courses/thumbnail_ngocnm.01.570-x-3451.png',NULL,'https://edumall.vn/courses/ky-nang-gay-anh-huong-va-thuyet-phuc-trong-cac-hanh-vi-ban-hang/detail','edumall.vn','899,000đ\nƯu đãi 77% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 17\nphút : 23\ngiây',0),(59,'20 Bài học cần thiết cho ngày đầu tiên đi làm','Phạm Văn Chính','Trong tình hình xã hội ngày càng phát triển như hiện nay, số lượng người thất nghiệp hàng năm đều lên đến con số hàng triệu. Và ngay cả khi bạn đã có việc làm thì để có chỗ đứng cũng như có cơ hội phát triển sự nghiệp, bạn cần biết cách ghi điểm trong mắt sếp và đồng nghiệp. Vậy làm thế nào để họ biết bạn là ai và bạn có thể làm gì? Làm thế nào để bạn không bị loại ra bởi những đối thủ khác nổi bật hơn?\nKhóa học này chính là thứ mà bạn tìm kiếm!\nDù bạn là ai hay làm ngành nghề gì, thì đây chính là một cuốn cẩm nang vô cùng cần thiết và hữu ích cho bạn:\n...','08090000','https://static.edumall.vn/uploads/images/courses/thumbnail_cpv01_570x345.png',NULL,'https://edumall.vn/courses/20-bai-hoc-can-thiet-cho-ngay-dau-tien-di-lam/detail','edumall.vn','399,000đ\nƯu đãi 50% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 19\nphút : 09\ngiây',0),(61,'Làm chủ \"Tài chính doanh nghiệp\"','Topica Uni','Trước khi một doanh nghiệp bước vào hoạt động cần chuẩn bị vô cùng kỹ càng, rất nhiều vấn đề được đặt ra nhưng tất cả đều phục vụ mục đích làm sao thu được nhiều lợi nhuận nhất có thể.\nChính vì vậy, tài chính luôn là keyword được quan tâm hàng đầu với mỗi công ty, đặc biệt với xu thế cổ phần hóa doanh nghiệp thì vấn đề tài chính càng nóng bỏng hơn bao giờ hết.','09000000','https://static.edumall.vn/uploads/images/courses/thumbnail_tai-chinh-doanh-nghiep.jpg',NULL,'https://edumall.vn/courses/tai-chinh-doanh-nghiep/detail','edumall.vn','299,000đ\nƯu đãi 33% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 16\nphút : 23\ngiây',0),(63,'Kỹ năng quản lý thời gian hiệu quả cho sinh viên','Phạm Anh Tuấn','Bạn nản lòng?\nChẳng làm được gì trong khi đống công việc ngày càng nhiều?\nKiệt sức?\nCần có thời gian cho bản thân?\nBạn cảm thấy bị mắc kẹt trong lịch trình bận rộn của mình?\nDanh sách những việc cần hoàn thành cuối mỗi ngày, mỗi tuần thậm chí là cuối tháng vẫn còn nhiều? \n ','00090000','https://static.edumall.vn/uploads/images/courses/thumbnail_quan-tri-thoi-gian-cho-sinh-vien---tuanpa-01.png',NULL,'https://edumall.vn/courses/quan-tri-thoi-gian-cho-sinh-vien/detail','edumall.vn','399,000đ\nƯu đãi 37% chỉ còn :\n249,000đ\n02\nngày : 03\ngiờ : 20\nphút : 17\ngiây',0),(64,'Nhạy bén trong quản trị rủi ro','Topica Uni','Thời buổi kinh tế thị trường, sự canh tranh giữa các doanh nghiệp càng trở nên gay gắt, môi trường kinh doanh phức tạp và nhiều biến động, chứa đựng nhiều tình huống không thể lường trước. Số doanh nghiệp hoàn tất thủ tục giải thể, chấm dứt hoạt động trong tháng 8 của cả nước là 834 doanh nghiệp, tăng 11,5% so với tháng 7 năm 2015.\nSố doanh nghiệp gặp khó khăn phải tạm ngừng hoạt động trong tháng này là 7.595 doanh nghiệp, tăng 27,9% so với tháng trước, trong đó: 1.460 doanh nghiệp đăng ký tạm ngừng hoạt động có thời hạn và 6.135 doanh nghiệp ngừng hoạt động chờ đóng mã số doanh nghiệp hoặc không đăng ký.','09000000','https://static.edumall.vn/uploads/images/courses/thumbnail_hghghghghghgh.jpg',NULL,'https://edumall.vn/courses/quan-tri-rui-ro/detail','edumall.vn','299,000đ\nƯu đãi 33% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 16\nphút : 17\ngiây',0),(65,'Phân tích thẩm định dự án đầu tư','Topica Uni','Chắc hẳn trong kỷ nguyên mà nền kinh tế phát triển vượt bậc, ai cũng có mong muốn kiếm thêm một khoản thu nhập ở các nguồn thu ngoài công việc cố định các bạn thường ngày vẫn làm. Bạn đã từng có ý định đầu tư vào một dự án nào đó, nhưng lại băn khoăn không biết có nên mạo hiểm?\nAi trong chúng ta cũng sẽ trở thành một \"nhà đầu tư tài ba\", luôn đúng đắn trong mọi quyết định và thu về một khoản lợi nhuận khủng nếu','09000000','https://static.edumall.vn/uploads/images/courses/thumbnail_dsa.jpg',NULL,'https://edumall.vn/courses/phan-tich-tham-dinh-du-an-dau-tu/detail','edumall.vn','299,000đ\nƯu đãi 33% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 15\nphút : 33\ngiây',0),(66,'Kế toán quản trị','Topica Uni','Trong nền kinh tế hiện nay, các doanh nghiệp phải thường xuyên dựa vào nhiều nguồn thông tin tài chính kế toán để ra quyết định quản trị nhằm đạt được kết quả tốt nhất trong quá trình sản xuất kinh doanh của mình. Do đó mà đối với quản lí, giám đốc, các trưởng phòng tài chính hay những nhân viên kế toán thì kế toán quản trị luôn luôn cần thiết và hữu ích.','09000000','https://static.edumall.vn/uploads/images/courses/thumbnail_ke-toan-quan-rti.jpg',NULL,'https://edumall.vn/courses/ke-toan-quan-tri/detail','edumall.vn','299,000đ\nƯu đãi 33% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 15\nphút : 38\ngiây',0),(67,'Tâm lý học quản trị kinh doanh','Topica Uni','Trong xã hội ngày nay, quản trị kinh doanh là hoạt động quan trọng cho bất kỳ tổ chức nào. Mỗi cơ quan tổ chức đều phải có hoạt động quản trị để nắm rõ tình hình hoạt động của mình. Để quá trình quản trị thuận lợi, hiệu quả hơn thì tâm lý học quản trị kinh doanh là một phần không thể thiếu. Dù bạn là nhân viên, hay là những nhà quản trị, quản lý bạn cũng cần phải có những hiểu biết cơ bản về tâm lý quản trị, cũng như những kỹ năng giao tiếp trong quá trình làm việc \nKhóa học này của chúng tôi được thiết kế dựa trên những học thuyết tâm lý quản trị song lại mang tính thực tiễn cao từ việc đúc kết những kinh nghiệm từ các công ty quốc tế cũng như những doanh nghiệp lớn trong nước. ','09040000','https://static.edumall.vn/uploads/images/courses/thumbnail_brain-wave.jpg',NULL,'https://edumall.vn/courses/tam-ly-hoc-quan-tri-kinhdoanh/detail','edumall.vn','299,000đ',0),(68,'Phân tích hoạt động kinh doanh','Topica Uni','Trong thời buổi kinh tế phát triển vượt bậc, xu hướng thành lập doanh nghiệp riêng ngày càng nhiều, dẫn đến tỉ lệ cạnh tranh khốc liệt và đào thải ngày càng lớn. Các chủ đầu tư hiện tại và tương lai luôn trăn trở lo ngại làm thế nào để giúp họ và doanh nghiệp của họ luôn phát triển và hoạt động hiệu quả ở mức tối đa?','09000000','https://static.edumall.vn/uploads/images/courses/thumbnail_570aa.jpg',NULL,'https://edumall.vn/courses/phan-tich-hoat-dong-kinh-doanh/detail','edumall.vn','299,000đ',0),(69,'Quản trị dự án','Topica Uni','Nền kinh tế hiện đại luôn đòi hỏi sự thay đổi khiến chúng ta thường xuyên phải làm việc với các dự án. Thế nhưng các số liệu thống kê từ một số trang thông tin lớn (Harvard Business Review, Forbes, ...) cho thấy có tới 60 - 70% các dự án thất bại mỗi năm, chỉ 30% dự án có khả năng \"sống\", 1/6 trong số đố chậm tiến độ, tiêu vượt quá kinh phí. \n\nVậy điều gì quyết đinh khả năng sống, sự thành công hay thất bại của một dự án? \n\nĐáp án của câu hỏi này có nhiều, nhưng có thể khẳng định, một trong những yếu tố quan trọng nhất là công tác quản trị dự án. \n\nKhóa học bao gồm các chủ đề chính: \n- Khái quát chung về quản trị dự án \n- Các phương pháp quản trị dự án \n- Đánh giá dự án dưới góc độ kỹ thuật, kinh tế và hiệu quả \n- Các công cụ thường dùng trong quản trị dự án (biểu đồ GANTT, sơ đồ PERT/CPM) \n- Quản trị rủi ro ','09000000','https://static.edumall.vn/uploads/images/courses/thumbnail_him-lam-cho-lon.jpg',NULL,'https://edumall.vn/courses/quan-tri-du-an/detail','edumall.vn','299,000đ',0),(70,'Quản trị chất lượng','Topica Uni','Những số liệu thống kê cho thấy rằng những công ty có vị thế cao hơn về chất lượng có thể thiết lập một mức giá bán cao hơn đến 8% so với các sản phẩm cùng loại của các công ty khác mà họ vẫn bán chạy hàng hơn. Ngoài ra, mức thu hồi vốn đầu tư giữa hai loại công ty này cùng có một mức chênh lệch khá lớn đó là 20% và 30%.\nNhư vậy, vấn đề chất lượng ngày nay không chỉ còn là một vấn đề kỹ thuật thuần tuý nữa mà đã trở thành một vấn đề mang tính chiến lược hàng đầu trong sản xuất – kinh doanh của các doanh nghiệp, tổ chức. Làm thế nào để quản lý được chất lượng sản phẩm? Làm sao để phân tích đánh giá chất lượng sản phẩm? Đảm bảo chất lượng - doanh thu? Đây là 3 câu hỏi trọng tâm mỗi doanh nghiệp đặc biệt quan tâm trong nền kinh tế thị trường, chúng sẽ được giải đáp đầy đủ chi tiết trong khóa học \"Quản trị chất lượng\"','09000000','https://static.edumall.vn/uploads/images/courses/thumbnail_trados.jpg',NULL,'https://edumall.vn/courses/quan-tri-chat-luong/detail','edumall.vn','299,000đ',0),(71,'Kỹ năng tìm kiếm thông tin trên Internet','Đỗ Thanh Tùng','Bạn có biết Internet là kho kiến thức của nhân loại? Trên Internet bạn có thể tìm được vô số thông tin bổ ích và các kiến thức về mọi lĩnh vực từ khoa học cho đến lịch sử, văn học… Bạn hãy tưởng tượng trước một kho thông tin như thế mà bạn chưa có mục đích tìm kiếm rõ ràng thì bạn sẽ vô cùng mất thời gian thậm chí bão hòa kiến thức vì lượng thông tin “nạp” vào trí nhớ quá nhiều.','40080000','https://static.edumall.vn/uploads/images/courses/thumbnail_sear.jpg',NULL,'https://edumall.vn/courses/ky-nang-tim-kiem-thong-tin-tren-internet/detail','edumall.vn','399,000đ',0),(72,'Tiếng Anh giao tiếp cơ bản khi đi mua sắm','Topica Native','Tiếng Anh ứng dụng là tuyển tập các bài cơ bản và ứng dụng được thực tế nhanh nhất trong giao tiếp hàng ngày.\n ','00930000','https://static.edumall.vn/uploads/images/courses/thumbnail_native.21.png',NULL,'https://edumall.vn/courses/tieng-anh-ung-dung--di-mua-sam/detail','edumall.vn','349,000đ\nƯu đãi 42% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 14\nphút : 33\ngiây',0),(73,'Tiếng Anh cơ bản khi tham gia giao thông','Topica Native','Trong giao tiếp hàng ngày, chúng ta có vô vàn vấn đề có thể nhắc đến, có thể là: Văn hóa, xã hội, con người .... Một vấn đề có sức ảnh hưởng khá lớn đó là \"Giao thông\". Trong tuyển tập Tiếng Anh ứng dụng, chúng tôi thiết kế và xây dựng trên nền tảng các video tình huống nổi bật về Giao thông trong tiếng Anh để các bạn có thể nắm được ở mức cơ bản và nhanh nhất có thể.','00930000','https://static.edumall.vn/uploads/images/courses/thumbnail_native.10.png',NULL,'https://edumall.vn/courses/tieng_anh_ung_dung_giao_thong_trong_tieng_anh/detail','edumall.vn','349,000đ\nƯu đãi 42% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 14\nphút : 08\ngiây',0),(74,'Tiếng Anh ứng dụng: Nhà hàng khách sạn trong Tiếng Anh','Topica Native','Nếu có cơ hội được sang một đất nước khác để du lịch hay để làm việc, bạn có muốn thử các món ăn ở nơi bạn đến? Nhưng bạn lại chẳng có đủ vốn từ vựng cũng như tự tin để giao tiếp.','00930000','https://static.edumall.vn/uploads/images/courses/thumbnail_native.12.png',NULL,'https://edumall.vn/courses/tieng_anh_ung_dung_nha_hang_khach_san_trong_tieng_anh/detail','edumall.vn','349,000đ\nƯu đãi 42% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 13\nphút : 45\ngiây',0),(75,'Tiếng Anh ứng dụng: Làm đẹp trong tiếng Anh','Topica Native','Tiếng Anh ứng dụng là tuyển tập các bài cơ bản và ứng dụng được thực tế nhanh nhất trong giao tiếp hàng ngày. Một trong số đó chúng tôi muốn giới thiệu tới các bạn đó là vấn đề \"Làm đẹp\". Vẫn là các tình huống cụ thể trực quan, được chia làm 4 phần rõ ràng: Listening, Speaking, Vocabulary, Pronunciation','00930000','https://static.edumall.vn/uploads/images/courses/thumbnail_native.13.png',NULL,'https://edumall.vn/courses/tien_anh_ung_dung_lam_dep_trong_tieng_anh/detail','edumall.vn','349,000đ\nƯu đãi 42% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 14\nphút : 57\ngiây',0),(76,'Tiếng Anh ứng dụng: Giải trí trong tiếng Anh','Topica Native','Nếu bạn đã hẹn được cô nàng/ anh chàng người nước ngoài tới buổi hẹn mà bạn đã mong chờ bấy lâu, bạn sẽ chuẩn bị những gì? Thiết kế cho mình một buổi hẹn tuyệt vời? Có một lời khuyên cho bạn rằng bạn nên trao dồi thật nhiều vốn tiếng Anh của mình về tất cả các mặt \"giải trí\" để hai bạn có thể thoải mái lựa chọn, cũng như trao đổi với nhau. Người bạn kia chắc hẳn sẽ cảm thấy bạn là người khá tâm lý và hiểu biết nhiều....','00930000','https://static.edumall.vn/uploads/images/courses/thumbnail_native.11.png',NULL,'https://edumall.vn/courses/tieng_anh_ung_dung_giai_tri_trong_tieng_anh/detail','edumall.vn','349,000đ\nƯu đãi 42% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 14\nphút : 21\ngiây',0),(77,'Ngữ pháp tiếng Anh cho người mới bắt đầu','Bianca Rayner','Bạn cần tiếng Anh cho sự nghiệp của mình?\nBạn không biết nói gì mỗi khi tham dự một cuộc phỏng vấn bằng tiếng Anh?\nTiếng Anh là nguyên nhân khiến cho bạn mất một hợp đồng quan trọng với đối tác nước ngoài?\nHay chỉ đơn giản bạn không tự tin khi nói chuyện với một người nước ngoài\nNếu bạn tìm thấy bản thân mình trong những câu hỏi trên thì đây chính là khóa học dành cho bạn.','00900000','https://static.edumall.vn/uploads/images/courses/thumbnail_native.08.jpg',NULL,'https://edumall.vn/courses/tieng-anh-ung-dung/detail','edumall.vn','349,000đ\nƯu đãi 42% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 13\nphút : 22\ngiây',0),(78,'Các tình huống thông dụng khi đi du lịch nước ngoài','Topica Native','Bao nhiêu lần bạn cần giúp đỡ, nhưng không thể diễn đạt bằng tiếng Anh? Thỉnh thoảng, tất cả điều bạn cần là hỏi một người lạ để cảm thấy tự tin hơn. Bạn có thể nghĩ họ sẽ không hiểu những điều bạn nói, vì bạn phát âm rất kém. Và đôi khi, bạn không có đủ các từ vựng để thể hiện những điều bạn cần nói. Điều này thật sự đúng khi bạn đi du lịch.\nĐừng lo lắng! Edumall gửi tới các bạn một món quà cực hấp dẫn dành cho các bạn có nhu cầu đi du lịch ở nước ngoài hoặc làm việc ở nước ngoài. Hãy đến với chúng tôi. Các tình huống thông dụng khi đi nước ngoài sẽ được thể hiện đầy đủ đầy màu sắc trong khóa học này.','00950000','https://static.edumall.vn/uploads/images/courses/thumbnail_65462135465.jpg',NULL,'https://edumall.vn/courses/tieng-anh-ung-dung-cac-tinh-huong-thong-dung-khi-di-du-lich-nuoc-ngoai/detail','edumall.vn','349,000đ\nƯu đãi 42% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 13\nphút : 05\ngiây',0),(79,'Tiếng Anh ứng dụng: Công việc trong tiếng Anh','Topica Native','Chắc chắn 99,99% các bạn đã đi làm và chưa đi làm đều hiểu tầm quan trọng của tiếng Anh. Nếu các bạn có mong muốn thăng tiến hơn, hoặc là để tìm 1 công việc tốt hơn, Tiếng Anh là 1 nấc thang trợ giúp mà bạn cần phải có.\nĐặc biệt trong phần này, Tiếng Anh ứng dụng sẽ giới thiệu tới các bạn về \"Công việc trong tiếng Anh\", một vấn đề sát sườn và vô cùng quan trọng với những ai đã, đang và sẽ đi làm. Bằng phương thức giảng dạy giàu hình ảnh và tiếp cận thực tế, các bạn có thể hiểu bài nhanh chóng và hiệu quả.','04920000','https://static.edumall.vn/uploads/images/courses/thumbnail_native.14.png',NULL,'https://edumall.vn/courses/tieng_anh_ung_dung_cong_viec_trong_tieng_anh/detail','edumall.vn','349,000đ\nƯu đãi 42% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 13\nphút : 28\ngiây',0),(80,'Nói chuyện với bạn nước ngoài đến du lịch bằng tiếng Anh','Topica Native','Vào một ngày đẹp trời, người bạn ngoại quốc của bạn ngỏ lời muốn tới thăm nơi bạn được sinh ra. Bạn hào hứng và đợi chờ cuộc gặp gỡ này, trong bạn nảy nở muôn vàn ý tưởng về những chuyến du lịch đến các miền quê, giới thiệu những món ăn ngon, đưa bạn ấy về gặp gia đình và bạn bè v.v...\nNhưng bạn không tự tin với tiếng Anh của bản thân, phải làm sao đây???\n ','00950000','https://static.edumall.vn/uploads/images/courses/thumbnail_native.03.png',NULL,'https://edumall.vn/courses/tieng-anh-ung-dung-noi-chuyen-voi-ban-nuoc-ngoai-den-du-lich/detail','edumall.vn','349,000đ\nƯu đãi 42% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 14\nphút : 44\ngiây',0),(81,'Học dấu câu tiếng Anh với người bản xứ','Egbert Veltman','Dấu câu tiếng Anh làm bạn đau đầu ư? Thế thì khóa học này thật sự cần thiết cho bạn!\nBạn đã phát ốm vì mọi người bảo bài viết của bạn như của một đứa trẻ? Bạn biết chính xác muốn diễn đạt cái gì, nhưng dấu câu lại khiến bạn bất lực? Dấu câu là lí do khiến bạn sự hãi khi mọi người đọc những gì bạn viết ra?','00900000','https://static.edumall.vn/uploads/images/courses/thumbnail_native.07.jpg',NULL,'https://edumall.vn/courses/tieng-anh-dau-cau-khong-kho/detail','edumall.vn','349,000đ\nƯu đãi 42% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 13\nphút : 40\ngiây',0),(82,'Trò chuyện với người nước ngoài theo cách tự tin nhất bằng tiếng Anh','Topica Native','Bạn ngại giao tiếp, đặc biệt là giao tiếp với người nước ngoài?\nBạn không biết trả lời như thế nào khi khách du lịch hỏi thăm về đất nước con người Việt Nam?\nVốn tiếng Anh của bạn còn hạn chế? Bạn mong muốn thay đổi khả năng giao tiếp của mình nhưng chưa biết phải bắt đầu từ đâu?\nTại đây chúng tôi hoàn toàn có thể giúp bạn thay đổi mọi thứ!','00950000','https://static.edumall.vn/uploads/images/courses/thumbnail_native.05.jpg',NULL,'https://edumall.vn/courses/tro-chuyen-voi-nguoi-nuoc-ngoai-theo-cach-tu-tin-nhat/detail','edumall.vn','349,000đ\nƯu đãi 42% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 13\nphút : 57\ngiây',0),(83,'Tiếng Anh ứng dụng: các mối quan hệ trong tiếng Anh','Topica Native','Nếu bắt gặp một chàng trai/ cô gái người nước ngoài xinh xắn, bạn có ngần ngại làm quen?\nMột trong những yếu tố khiến chúng ta không thể hiểu nhau đó là bất đồng ngôn ngữ. Nếu như chúng ta ai cũng được trang bị 1 loại Tiếng phổ cập trên toàn thế giới thì chắc chắn những mối quan hệ xung quanh của bạn sẽ nhiều màu sắc hơn.\nDo đó, chúng tôi dựa trên những nhu cầu thiết yếu này để xây dựng một khóa học vô cùng hữu ích đó là \"Các mối quan hệ trong Tiếng Anh\". Bằng các phương pháp giảng dạy thực tiễn hoàn toàn mới, giảng viên giúp người học hứng khởi và tiếp thu bài học nhanh chóng.\n ','00930000','https://static.edumall.vn/uploads/images/courses/thumbnail_native.16.png',NULL,'https://edumall.vn/courses/tieng_anh_ung_dung_cac_moi_quan_he_trong_tieng_anh/detail','edumall.vn','349,000đ\nƯu đãi 42% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 12\nphút : 51\ngiây',0),(84,'Tiếng Anh ứng dụng: Nhà cửa trong Tiếng Anh','Topica Native','Nếu bạn đang chuẩn bị trở thành 1 du học sinh, hay kể như bạn chuẩn bị đi làm đất nước khác. Điều đầu tiên bạn sẽ làm gì? Tôi cá chắc rằng bạn sẽ phải trang bị cho mình vốn Tiếng Anh tương đối để có thể giao tiếp hàng ngày. Chúng tôi hiểu được nhu cầu thiết yếu này đã tổng hợp và thiết kế khóa học \"Nhà cửa trong Tiếng Anh\" thông qua các video tình huống trực quan nhất giúp bạn có thể nhanh chóng tiếp thu trong tuyển tập Tiếng Anh ứng dụng.','00930000','https://static.edumall.vn/uploads/images/courses/thumbnail_native.17.png',NULL,'https://edumall.vn/courses/tieng_anh_ung_dung_nha_cua_trong_tieng_anh/detail','edumall.vn','349,000đ\nƯu đãi 42% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 12\nphút : 37\ngiây',0),(85,'Giao thông trong Tiếng Anh','Topica Native','Trong giao tiếp hàng ngày, chúng ta có vô vàn vấn đề có thể nhắc đến, có thể là: Văn hóa, xã hội, con người .... Một vấn đề có sức ảnh hưởng khá lớn đó là \"Giao thông\".\nTrong tuyển tập Tiếng Anh ứng dụng kỳ trước, chúng tôi có giới thiệu tới các bạn sơ qua các mặt cơ bản về giao thông, trong kỳ này chúng tôi đưa tới học viên bài học chuyên sâu hơn \"Các vấn đề về Giao thông trong Tiếng Anh\".\n ','00930000','https://static.edumall.vn/uploads/images/courses/thumbnail_native.18.png',NULL,'https://edumall.vn/courses/tieng_anh_ung_dung_cac_van_de_giao_thong_trong_tieng_anh/detail','edumall.vn','349,000đ\nƯu đãi 42% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 12\nphút : 25\ngiây',0),(86,'Tiếng Anh ứng dụng: Học đại học','Topica Native','Nếu có cơ hội được sang một đất nước khác để học tập hay để làm việc, bạn có muốn trò chuyện vui vẻ với những người bạn mới ở nơi bạn đến? Nhưng bạn lại chẳng có đủ vốn từ vựng cũng như tự tin để giao tiếp. Dù thời gian là ngắn hay dài để trải niệm, chúng ta vẫn cần trang bị cho mình vốn Tiếng Anh về chủ đề \"Trường Đại học\". Hiểu được những yêu cầu thiết yếu này, chúng tôi đã xây dựng thêm khóa học trong đó bạn được tham gia vào các tình huống cụ thể và xác thực nhất.','00930000','https://static.edumall.vn/uploads/images/courses/thumbnail_native.22.png',NULL,'https://edumall.vn/courses/tieng-anh-ung-dung-w17/detail','edumall.vn','349,000đ',0),(88,'Tiếng Anh ứng dụng: Tiệc liên hoan tại công ty','Topica Native','Chắc chắn 99,99% các bạn đã đi làm và chưa đi làm đều hiểu tầm quan trọng của tiếng Anh. Nếu các bạn có mong muốn thăng tiến hơn, hoặc là để tìm 1 công việc tốt hơn, Tiếng Anh là 1 nấc thang trợ giúp mà bạn cần phải có.\nTrong công việc có rất nhiều tình huống xảy ra, và trong khóa học \"Tiếng anh ứng dụng: tiệc liên hoan tại công ty\" sẽ giúp bạn biết và vận dụng được các mẫu câu trong tình huống này. Bằng phương thức giảng dạy giàu hình ảnh và tiếp cận thực tế, các bạn có thể hiểu bài nhanh chóng và hiệu quả.','03950000','https://static.edumall.vn/uploads/images/courses/thumbnail_570.jpg',NULL,'https://edumall.vn/courses/tieng-anh-ung-dung-w10/detail','edumall.vn','299,000đ',0),(89,'Tiếng Anh ứng dụng: Các vấn đề sức khoẻ trong Tiếng Anh','Topica Native','Nếu bạn đang chuẩn bị trở thành 1 du học sinh, hay kể như bạn chuẩn bị đi làm đất nước khác. Điều đầu tiên bạn sẽ làm gì?\nTôi cá chắc rằng bạn sẽ phải trang bị cho mình vốn Tiếng Anh tương đối để có thể giao tiếp hàng ngày. Nhưng các bạn có quên mất điều gì không? Ở các nước phát triển, các nhà thuốc tuyệt đối không bán thuốc bừa bãi như ở Việt Nam. Cần phải có đơn kê của bác sỹ chủ trị thì mới được bán cho người dùng. Vậy nếu có 1 vấn đề gì về sức khỏe, chính bản thân các bạn cũng loay hoay không biết hỏi ai. Chúng tôi tổng hợp và thiết kế khóa học \"Các vấn đề về sức khỏe trong Tiếng Anh\" thông qua các video tình huống trực quan nhất giúp bạn có thể nhanh chóng tiếp thu.','00900500','https://static.edumall.vn/uploads/images/courses/thumbnail_native.09.570-x-3451.png',NULL,'https://edumall.vn/courses/tieng_anh_ung_dung_cac_van_de_suc_khoe_trong_tieng_anh/detail','edumall.vn','349,000đ\nƯu đãi 42% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 11\nphút : 17\ngiây',0),(90,'Ngữ pháp Tiếng Anh cho người đi làm','Bianca Rayner','Bạn cần tiếng Anh cho sự nghiệp của mình?\nBạn không biết nói gì mỗi khi tham dự một cuộc phỏng vấn bằng tiếng Anh?\nTiếng Anh là nguyên nhân khiến cho bạn mất một hợp đồng quan trọng với đối tác nước ngoài?\nHay chỉ đơn giản bạn không tự tin khi nói chuyện với một người nước ngoài.\nNếu bạn tìm thấy bản thân mình trong nhưng câu hỏi trên thì đây chính là khóa học dành cho bạn.\n ','03900000','https://static.edumall.vn/uploads/images/courses/thumbnail_nt02_570x345.png',NULL,'https://edumall.vn/courses/tieng-anh-ung-dung-ngu-phap-tieng-anh-cho-nguoi-di-lam/detail','edumall.vn','349,000đ\nƯu đãi 42% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 11\nphút : 12\ngiây',0),(91,'Vấn đề nhà ở trong Tiếng Anh','Topica Native','Nếu bạn đang chuẩn bị trở thành 1 du học sinh, hay kể như bạn chuẩn bị đi làm đất nước khác. Điều đầu tiên bạn sẽ làm gì? Tôi cá chắc rằng bạn sẽ phải trang bị cho mình vốn Tiếng Anh tương đối để có thể giao tiếp hàng ngày. Chúng tôi hiểu được nhu cầu thiết yếu này đã tổng hợp và thiết kế khóa học \"Nhà ở trong Tiếng Anh\" thông qua các video tình huống trực quan nhất giúp bạn có thể nhanh chóng tiếp thu trong tuyển tập Tiếng Anh ứng dụng.','00930000','https://static.edumall.vn/uploads/images/courses/thumbnail_cua-phong-thuy.jpg',NULL,'https://edumall.vn/courses/nha-o-trong-tieng-anh/detail','edumall.vn','349,000đ',0),(93,'Làm chủ Adobe Photoshop CC trong 3 giờ','tientt','Làm sao để có những bức ảnh đẹp, được nhiều lượt Like và Comment của bạn bè?\nLàm sao để thiết kế những sản phẩm độc đáo, thể hiện cá tính của bạn?\nHay chỉ đơn thuần là làm sao để có những banner, poster hỗ trợ đắc lực cho công việc của bạn?\nBạn muốn tự mình làm được tất cả những điều trên?\nKhóa học \"Làm chủ Photoshop CC trong 3 giờ\" sẽ giúp bạn những kỹ năng, thao tác cần thiết nhất để làm chủ Adobe Photoshop CC','40000090','https://static.edumall.vn/uploads/images/courses/thumbnail_thumbnail_ttt01_570x345.png',NULL,'https://edumall.vn/courses/lam-chu-adobe-photoshop-cc-trong-ba-gio/detail','edumall.vn','599,000đ\nƯu đãi 50% chỉ còn :\n299,000đ\n02\nngày : 03\ngiờ : 09\nphút : 56\ngiây',0),(94,'Tiếng Anh giao tiếp cho người mới bắt đầu','Topica Native','Vốn tiếng Anh của bạn còn hạn chế? Bạn mong muốn thay đổi khả năng giao tiếp của mình nhưng chưa biết phải bắt đầu từ đâu?\nKhóa học này là lựa chọn hoàn hảo giúp bạn cải thiện vốn tiếng Anh nghèo nàn, khả năng giao tiếp hạn chế của mình.','00940000','https://static.edumall.vn/uploads/images/courses/thumbnail_o-college-students-talking-facebook.jpg',NULL,'https://edumall.vn/courses/tieng-anh-cho-nguoi-moi-bat-dau/detail','edumall.vn','349,000đ',0),(95,'Dựng video chuyên nghiệp với Adobe Premiere','Triệu Đình Nam','Người dựng phim giỏi không chỉ là người cắt gọt, mà anh ấy chính là người kể chuyện, thổi hồn cho những chuỗi hình ảnh chạy dài, diễn đạt cảm xúc nhân vật hay tạo cao trào, kịch tính cho một tác phẩm.\nVà trong lĩnh vực dựng phim, có rất nhiều phần mềm xử lý hậu kỳ để người dựng phim hiện thực hóa những điều trên. Tuy nhiên theo đánh giá mới nhất của các editor hàng đầu và giới điện ảnh trong và ngoài nước, thì Adobe Premiere được ưu ái chấm điểm cao nhất, là công cụ dựng phim thân thiện, có tỉ lệ sử dụng lớn nhất hiện nay tại hầu hết các hãng phim, công ty truyền hình, truyền thông và quảng cáo.\n ','40000090','https://static.edumall.vn/uploads/images/courses/thumbnail_premiere-pro-865x505.jpg',NULL,'https://edumall.vn/courses/dung-phim-chuyen-nghiep-voi-adobe-premiere/detail','edumall.vn','499,000đ\nƯu đãi 40% chỉ còn :\n299,000đ\n02\nngày : 03\ngiờ : 10\nphút : 03\ngiây',0),(96,'Học After Effects cơ bản','Lâm Văn Tư','Nếu bạn là Graphic Designer, Video Editor... hay đơn giản chỉ là người yêu sự độc đáo chắc chắc các bạn sẽ quan tâm đến After Effects. After Effects ( hay còn gọi là AE ) là một sự lựa chọn hoàn hảo phục vụ cho công việc và giải trí của bạn, là một phần mềm chuyên về xử lý phim, diễn hoạt hoạt hình, motion graphic và biên tập hậu kỳ cho các sản phẩm 3D.\nKhoá \"Học After Effects cơ bản\" sẽ trang bị cho bạn từ những kỹ năng nền tảng nhất đến mức nâng cao hơn trong After Effects. Giúp bạn có thể sử dụng After Effects để xử lý hình hiệu intro, ending cho video, banner… After Effects sẽ góp phần tạo 1 sản phẩm tuyệt vời cho bạn.','40000090','https://static.edumall.vn/uploads/images/courses/thumbnail_93a_48b_580_580-adobe-after-effects-1.jpg',NULL,'https://edumall.vn/courses/hoc-after-effects-co-ban/detail','edumall.vn','Miễn phí',0),(98,'Illustrator CS6 cơ bản','Sắp ra mắt','Adobe Illustrator là phần mềm vector được đánh giá rất cao trong tạo hình dạng cơ bản ứng dụng nhiều nhất trong thiết kế in ấn, logo, biển quảng cáo, cataloge, brochure, thiết kế thời trang, thiết kế hình ảnh cho web, dàn trang tạp chí... Với ưu điểm là dễ dàng chuyển giao dữ liệu với các phần mềm khác, xuất file nhẹ, mầu in chuẩn, thư viện mẫu vẽ và symbol phong phú… Phiên bản mới nhất hiện nay có thể vẽ được cả các đối tượng 3D đó là Illustrator CS6.','40000090','https://static.edumall.vn/uploads/images/courses/thumbnail_ai.jpg',NULL,'https://edumall.vn/courses/illustrator-cs6-co-ban/detail','edumall.vn','',0),(99,'Kỹ thuật đồ họa','Topica Uni','Bạn thích thú trước những bộ phim 3D với hình ảnh sống động đẹp như thật.\nBạn trải nghiệm Game với đồ họa, âm thanh hấp dẫn.\nBạn ngắm nhìn những khung hình màu sắc đầy chất thơ...','40000090','https://static.edumall.vn/uploads/images/courses/thumbnail_dfdfdfdfdfdfdf.jpg',NULL,'https://edumall.vn/courses/ky-thuat-do-hoa/detail','edumall.vn','449,000đ\nƯu đãi 55% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 09\nphút : 36\ngiây',0),(101,'Marketing liên kết','Nguyễn Tài Tuệ','Sự phát triển vũ bão của internet tạo đà cho nhiều doanh nhân xây dựng doanh nghiệp thành công với nguồn thu nhập online ổn định. Họ thậm chí không sở hữu sản phẩm, không cung cấp dịch vụ giao hàng mà vẫn đạt được mức doanh thu khủng chính là do họ tham gia vào mạng lưới marketing liên kết. \n\nTừ marketer, doanh nhân, nhà sản suất đến người có website riêng, có sẵn traffic và danh sách khách hàng hay chính bạn đều là những mắt xích quan trọng trong mạng lưới Marketing liên kết. Tuy nhiên để làm chủ và tạo ra nguồn thu nhập online ổn định thì cần tìm hiểu và thực hành Marketing liên kết theo lộ trình bài bản, thực tiễn và xác thực. ','49000000','https://static.edumall.vn/uploads/images/courses/thumbnail_ntt01_570x345.png',NULL,'https://edumall.vn/courses/marketing-lien-ket/detail','edumall.vn','399,000đ\nƯu đãi 25% chỉ còn :\n299,000đ\n02\nngày : 03\ngiờ : 08\nphút : 38\ngiây',0),(102,'Google Adwords cơ bản cho người mới bắt đầu','Nguyễn Tiến Nghĩa','Google Adwords được xem là kênh quảng cáo giúp bạn tìm kiếm và tiếp cận khách hàng nhanh chóng, hiệu quả và đồng thời tiết kiệm chi phí nhất so với các kênh quảng cáo khác. Bạn thắc mắc vì sao ư?\nKhóa học này sẽ giúp bạn trả lời câu hỏi đó, giúp bạn hiểu rõ hơn về công cụ quảng cáo hàng đầu thế giới với sự giảng dạy bởi anh Nguyễn Tiến Nghĩa - 1 trong 5 chuyên gia hàng đầu về Google Adwords của Việt Nam.\n ','58000000','https://static.edumall.vn/uploads/images/courses/thumbnail_thumbnail_animations.aep.00_00_02_23.still002.png',NULL,'https://edumall.vn/courses/google-adwords-co-ban-cho-nguoi-moi-bat-dau/detail','edumall.vn','399,000đ\nƯu đãi 25% chỉ còn :\n299,000đ\n02\nngày : 03\ngiờ : 08\nphút : 33\ngiây',0),(103,'10 bước để làm SEO','Vương Mạnh Hoàng','Dù bạn là marketer, nhân viên kinh doanh hay là quản trị website thì chiến lược SEO phù hợp cho trang web và sản phẩm của bạn luôn luôn thật sự cần thiết. Vậy đâu là cách làm SEO đúng đắn?\nHiểu được điều đó, tôi đã cùng Edumall xây dựng khóa học \"10 bước để làm SEO\". Với cách truyền đạt hấp dẫn, lôi cuốn cùng sự tương tác với học viên thông qua các câu hỏi và case study, tôi mong muốn giúp các bạn: Hiểu được kiến thức nền và sử dụng thành thạo các công cụ SEO, biết cách chuẩn SEO và định hướng chiến lược SEO đúng hướng.','58000000','https://static.edumall.vn/uploads/images/courses/thumbnail_570seo.png',NULL,'https://edumall.vn/courses/10-buoc-de-lam-seo/detail','edumall.vn','399,000đ\nƯu đãi 25% chỉ còn :\n299,000đ\n02\nngày : 03\ngiờ : 08\nphút : 26\ngiây',0),(104,'Xây dựng chiến lược marketing hoàn hảo','Topica Uni','Trong môi trường kinh doanh cạnh tranh ngày một gay gắt, mọi doanh nghiệp muốn đứng vững và phát triển thì đều cần chú trọng đầu tư cho marketing. Kiến thức về marketing đem đến cơ hội nghề nghiệp vô tận.','09000000','https://static.edumall.vn/uploads/images/courses/thumbnail_570x345.jpg',NULL,'https://edumall.vn/courses/marketing-can-ban/detail','edumall.vn','399,000đ\nƯu đãi 50% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 08\nphút : 18\ngiây',0),(105,'Quản trị Marketing','Topica Uni','Marketing từ lâu đã trở thành một hoạt động không thể thiếu của các doanh nghiệp mà quản trị Marketing là một trong những vấn đề cần được quan tâm. Quản trị Marketing có vị trí và vai trò quan trọng đối với các hoạt động quản trị khác trong doanh nghiệp: quản trị tài chính, quản trị sản xuất, quản trị nhân sự. Quản trị Marketing có tác dụng định hướng cho các hoạt động quản trị khác qua việc chỉ rõ nhu cầu của các khách hàng mục tiêu, áp lực của cạnh tranh và sự đề nghị cung ứng một hệ thống sản phẩm và dịch vụ thích hợp.','09000000','https://static.edumall.vn/uploads/images/courses/thumbnail_uni.18.png',NULL,'https://edumall.vn/courses/quan-tri-marketing/detail','edumall.vn','399,000đ',0),(106,'Bán hàng và quảng cáo trên facebook','Sắp ra mắt',' Khóa học tổng hợp nhất và chuyên sâu nhất về chiến lươc bán hàng trên Facebook - Các công cụ bán hàng trực tuyến tốt nhất hiện nay. Được hỗ trợ vào một Group kín chỉ dành cho học viên, hỗ trợ trọn đời. Khóa học được tùy biến cao và dựa trên kinh nghiệm giảng dạy cũng như tư vấn hàng nghìn học viên, hàng trăm doanh nghiệp \nGiảng dạy bởi giảng viên Đại học; Chuyên gia về E-Marketing; có chuyên môn sâu về Thương mại điện tử và Marketing điện tử. Đồng thời là đồng sáng lập 02 công ty đang kinh doanh thành công trên thị trường. \nGiảng viên giàu kinh nghiệm thực tế và đã đào tạo hàng nghìn học viên trong nhiều năm về e-marketing, facebook, google, email, seo… Chạy quảng cáo hàng tỷ đồng/ tháng. Từng đào tạo cho nhiều công ty lớn như VTC, MobiFone, AlphaFood v.v…','49000000','https://static.edumall.vn/uploads/images/courses/thumbnail_face.jpg',NULL,'https://edumall.vn/courses/ban-hang-va-quang-cao-tren-facebook/detail','edumall.vn','',0),(107,'Marketing với Twitter cơ bản: Tăng Follower mỗi ngày!','Sắp ra mắt','Twitter là dịch vụ mạng xã hội miễn phí cho phép người sử dụng đọc, nhắn và cập nhật các mẩu tin nhỏ gọi là tweet, một dạng tiểu blog. Thành lập từ năm 2006, Twitter đã trở thành một hiện tượng phố biến toàn cầu. Những tweet có thể chỉ là dòng tin vặt cá nhân cho đến những cập nhật thời sự tại chỗ kịp thời và nhanh chóng hơn cả truyền thông chính thống. \nVậy khóa học này sẽ giúp bạn cái gì?','49000000','https://static.edumall.vn/uploads/images/courses/thumbnail_tw.jpg',NULL,'https://edumall.vn/courses/marketing-voi-twitter-co-ban-tang-follower-moi-ngay/detail','edumall.vn','',0),(109,'Hướng dẫn sử dụng Powerpoint 2007','Tiện ích văn phòng','Bạn đang là một chuyên viên Marketing? một nhà tổ chức sự kiện chuyên nghiệp?\nBạn lúng túng với việc trình bày thật ấn tượng ý tưởng hay kế hoạch trên PowerPoint?','03000009','https://static.edumall.vn/uploads/images/courses/thumbnail_570thathathakkkk.jpg',NULL,'https://edumall.vn/courses/huong-dan-su-dung-powerpoint-2007/detail','edumall.vn','Miễn phí',0),(110,'Microsoft Excel 2010: Từ Sơ cấp đến Trung cấp','Nguyễn Văn Kỳ','Bạn đau đầu với những con số phải xử lí hàng ngày, bạn gặp nhiều khó khăn trong việc quản lí công việc văn phòng? Hãy chấm dứt tất cả những điều tệ hại này ngay hôm nay bằng cách khởi động với Excel 2010. \nExcel 2010 chính là người bạn đồng hành tốt nhất của nhân viên văn phòng, kế toán, những người thao tác nhiều với số liệu hay cả với sinh viên, học sinh để giúp họ tăng tốc công việc và quản lí dữ liệu hiệu quả.\nChính vì thế, tôi đã cùng Edumall xây dựng khóa học \"Microsoft Excel 2010: Từ Sơ cấp đến Trung cấp\". Với nội dung bài học được chia nhỏ theo từng tính năng kết hợp với phương pháp thực hành trực quan, tôi sẽ giúp các bạn: Nắm vững các tính năng của Excel 2010, vận dụng thành thạo các hàm tính cơ bản và nâng cao vào công việc, bảo mật file excel, đồng thời quản lí tài liệu và email hiệu quả.','32000009','https://static.edumall.vn/uploads/images/courses/thumbnail_kunvthatha570.jpg',NULL,'https://edumall.vn/courses/microsoft-excel-2010--tu-so-cap-den-trung-cap/detail','edumall.vn','649,000đ\nƯu đãi 69% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 07\nphút : 29\ngiây',0),(111,'Tăng hiệu quả và năng suất công việc với VBA và Excel','Nguyễn Đức Thanh','Nếu tiếp thu được đầy đủ kiến thức trong khoá học này, học viên sẽ:\n- Học viên được trao đổi với người hướng dẫn trên forum của khoá học và được nhận những gợi ý về cách học và phát triển chương trình\n- Học viên làm quen với ngôn ngữ lập trình VBA và ngôn ngữ truy vấn dữ liệu SQL trong Excel\n- Học viên tự viết hoặc sửa được code VBA trong trường hợp đơn giản để phục vụ công việc\n- Học viên có thể sửa lại các ví dụ trong bài học để áp dụng cho công việc của mình\n ','56000009','https://static.edumall.vn/uploads/images/courses/thumbnail_thumbnail_ndt02_570x345.png',NULL,'https://edumall.vn/courses/tang-hieu-qua-va-nang-suat-cong-viec-voi-vba-va-excel/detail','edumall.vn','599,000đ\nƯu đãi 50% chỉ còn :\n299,000đ\n02\nngày : 03\ngiờ : 07\nphút : 45\ngiây',0),(112,'Excel ứng dụng cho kế toán và hành chính nhân sự','Nguyễn Thị Hương Thuỷ','Bạn không cần là một người giỏi logic.\nBạn không cần là siêu sao về excel.\nNhưng bạn vẫn có thể sử dụng, ứng dụng những hàm rất đơn giản, cơ bản vào trong công việc.','08000009','https://static.edumall.vn/uploads/images/courses/thumbnail_ke-toan-hahaha.jpg',NULL,'https://edumall.vn/courses/excel-ke-toan-hanh-chinh-nhan-su/detail','edumall.vn','499,000đ',0),(113,'Học nhanh Windows 10 với 50 thủ thuật','Sắp ra mắt','Microsoft Windows luôn nâng cấp và cải tiến hệ điều hành dành cho PC. Việc nâng cấp từ windows 7 lên windows 10 không quá khó khăn. Nhưng làm sao để có thể tận dụng tối đa được những tiện ích mà hệ điều hành này mang lại? Trong khóa học này bạn sẽ được tìm hiểu 50 thủ thuật không thể bỏ qua nếu muốn làm chủ hệ điều hành Window 10.','40020008','https://static.edumall.vn/uploads/images/courses/thumbnail_wwin10.jpg',NULL,'https://edumall.vn/courses/hoc-nhanh-windows-8-voi-50-thu-thuat/detail','edumall.vn','',0),(114,'Thuyết trình hoàn hảo với công cụ Prezi','Sắp ra mắt','Đây là khóa học thiết kế và đồ họa, làm các bài thuyết trình với Prezi. Dưới đây là các nội dung chúng ta sẽ tìm hiểu trong khóa học này:\n1. Tạo một tài khoản Prezi \n- Từ trang web \n- Tải ứng dụng iPad (tùy chọn ) \n- Tạo một Prezi mới \n2. Lập Trình bày Prezi \nKế hoạch ra những điều bạn muốn trình bày. \n- Tùy chỉnh Prezi của bạn \n- Thêm nội dung vào Prezi của bạn \n- Thêm hình ảnh động GIF \n3. Chỉnh sửa Prezi \n- Chỉnh sửa và Thao tác với các nội dung có trên Prezi \n4. Thiết lập cho một bài thuyết trình Prezi \n- Chèn khung hình để tạo ra \" \" slide \" \" \n- Tạo đường dẫn \n5. Tải và Trình bày Prezi của bạn ','04000009','https://static.edumall.vn/uploads/images/courses/thumbnail_pezi.jpg',NULL,'https://edumall.vn/courses/thuyet-trinh-hoan-hao-voi-cong-cu-prezi/detail','edumall.vn','',0),(115,'Làm chủ Excel 2010 trong 4 giờ','Thạc sỹ Nguyễn Danh Tú','Cập nhật phiên bản mới: \"Làm chủ Excel 2010 trong 4 giờ\" với nhiều bài giảng và bài tập mới được đầu tư công phu về nội dung và hình thức.\n- Cập nhật thêm nhiều bài giảng mới được hệ thống hợp lý từ cơ bản đến nâng cao.\n- Mỗi bài giảng đều có phần Casestudy dẫn nhập và phần bài tập thực hành về nhà. Phần lý thuyết có cùng minh họa dễ hiểu giúp học viên tiếp thu dễ dàng.\n- Giảng dạy trên phiên bản mới, có nhiều công cụ và thao tác hữu ích, giúp tăng tốc công việc của bạn hơn.\n- Cập nhật thêm nhiều bài tập thực hành mới và bài tập cuối khoá.\n- Bài tập cuối khoá như một \"món quà\" dành tặng các bạn học viên khi đã hoàn thành khoá học. Khi học xong cả khoá học và làm bài thực hành cuối khoá, các bạn đã sở hữu một công cụ mạnh mẽ giúp ích cho công việc của các bạn. Không những thế, các học viên khi hoàn thành xong bài cuối khoá còn có cơ hội nhận được các ưu đãi khi tham gia các khoá học tiếp theo về Excel chuyên ngành do thầy Nguyễn Danh Tú giảng dạy!\n ','00000009','https://static.edumall.vn/uploads/images/courses/thumbnail_tu-570.png',NULL,'https://edumall.vn/courses/lam-chu-excel-2010-trong-4-gio/detail','edumall.vn','599,000đ\nƯu đãi 66% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 06\nphút : 35\ngiây',0),(116,'Excel cho người đi làm','Nguyễn Đức Thanh','Bạn có kỹ năng sử dụng Excel cơ bản, nhưng như thế đã đủ để đáp ứng công việc?\nBạn vẫn thường xuyên phải hỏi những đồng nghiệp khác về những chức năng nâng cao của Excel?\nBạn phải tổng hợp, phân tích và làm báo cáo liên tục và nó chiếm quá nhiều thời gian khiến bạn chật vật với những công việc khác?\nMột kỹ năng có thể cải thiện lại đang trở thành một hòn đá cản trở việc thăng tiến của bạn.','04000009','https://static.edumall.vn/uploads/images/courses/thumbnail_ndt01_570x34sadasdew5.png',NULL,'https://edumall.vn/courses/lam-viec-hieu-qua-va-nang-suat-hon-voi-excel/detail','edumall.vn','599,000đ\nƯu đãi 58% chỉ còn :\n249,000đ\n02\nngày : 03\ngiờ : 06\nphút : 29\ngiây',0),(119,'Xây dựng Đạo đức - Văn hóa trong kinh doanh','Topica Uni','Đạo đức kinh doanh và văn hóa doanh nghiệp đã và đang trở thành một nhân tố có tác động tới mọi khía cạnh hoạt động kinh doanh của doanh nghiệp.\nĐạo đức kinh doanh gồm nhiều yếu tố, từ tổ chức quản lý hoạt động kinh doanh, các quan hệ trong và ngoài doanh nghiệp cho đến phong thái, phong cách của người lãnh đạo và cách ứng xử giữa các thành viên trong doanh nghiệp.\n ','09050000','https://static.edumall.vn/uploads/images/courses/thumbnail_shshshshs.jpg',NULL,'https://edumall.vn/courses/dao-duc-van-hoa-kinh-doanh/detail','edumall.vn','299,000đ\nƯu đãi 33% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 06\nphút : 12\ngiây',0),(120,'Luật hành chính','Topica Uni','Khóa học gồm 5 chương với 24 bài giảng, thiết kế dựa trên nhưng văn bản luật hành chính mới nhất, đề cập tới những vấn đề thực tiễn, những kiến thức về quản lý hành chính, quản lý nhà nước. Sau khi tham gia khóa học bạn có thể hiểu và nắm rõ được những kiến thức cơ bản về luật hành chính.','08000000','https://static.edumall.vn/uploads/images/courses/thumbnail_wrongful-death-law31.jpg',NULL,'https://edumall.vn/courses/luat-hanh-chinh/detail','edumall.vn','399,000đ\nƯu đãi 50% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 06\nphút : 06\ngiây',0),(126,'Luật hôn nhân và gia đình','Topica Uni','Bạn đang gặp rắc rối trong quá trình giải quyết các vấn đề về phân chia tài sản sau hôn nhân, các vấn đề liên quan tới luật hôn nhân và gia đình? Bạn đang chuẩn bị kết hôn và cảm thấy còn mơ hồ về những vấn đề xoay quanh luật hôn nhân gia đình, muốn tìm hiểu để có được những hiểu biết nhất định khi chính thức bước vào cuộc sống hôn nhân? Hay đơn giản chỉ là bạn tò mò muốn nắm rõ hơn về luật hôn nhân gia đình? Khoá học về luật \"Hôn nhân gia đình\" này là lựa chọn thích hợp dành cho bạn.','00009000','https://static.edumall.vn/uploads/images/courses/thumbnail_hon-nhan.jpg',NULL,'https://edumall.vn/courses/luat-hon-nhan-va-gia-dinh/detail','edumall.vn','399,000đ\nƯu đãi 50% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 05\nphút : 23\ngiây',0),(130,'Luyện tập ngữ pháp Tiếng Anh cho người đi làm','Bianca Rayner','Bạn cần tiếng Anh cho sự nghiệp của mình?\nBạn không biết nói gì mỗi khi tham dự một cuộc phỏng vấn bằng tiếng Anh?\nTiếng Anh là nguyên nhân khiến cho bạn mất một hợp đồng quan trọng với đối tác nước ngoài?\nHay chỉ đơn giản bạn không tự tin khi nói chuyện với một người nước ngoài\nNếu bạn tìm thấy bản thân mình trong nhưng câu hỏi trên thì đây chính là khóa học dành cho bạn.\n ','04900000','https://static.edumall.vn/uploads/images/courses/thumbnail_course_image_ngu-phap-tieng-anh-co-ban.png',NULL,'https://edumall.vn/courses/tieng-anh-ung-dung-ngu-phap-tieng-anh-co-ban/detail','edumall.vn','349,000đ\nƯu đãi 42% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 13\nphút : 17\ngiây',0),(131,'Phân tích tài chính kế toán bằng Microsoft Excel','Nguyễn Thành Đông','Cung cấp kiến thức từ cơ bản đến chuyên sâu áp dụng được ngay vào thực tế học tập và công việc cho các đối tượng học sinh, sinh viên, nhân viên văn phòng và quản lý công ty.\nCác nội dung chính: Giới thiệu Excel, xử lý số liệu, định dạng bảng tính, xây dựng công thức và giải pháp dựa trên nhóm hàm, giải thuật toán với Solver và What\'s If, phân tích tình huống với Scenario Manager.','08000009','https://static.edumall.vn/uploads/images/courses/thumbnail_excel-tai-chinh-570.jpg',NULL,'https://edumall.vn/courses/phan-tich-tai-chinh-ke-toan-bang-microsoft-excel/detail','edumall.vn','699,000đ\nƯu đãi 57% chỉ còn :\n299,000đ\n02\nngày : 03\ngiờ : 07\nphút : 36\ngiây',0),(134,'Tiếng anh ứng dụng: Tự tin giao tiếp trong công việc bằng tiếng anh','Topica Native','Khóa học là tổng hợp các bài giảng video trực quan, bao quát hầu hết các trường hợp xảy ra trong môi trường công sở đòi hỏi phải sự dụng tiếng anh để giao tiếp.\n\nNếu bạn đang còn rụt rè khi nói chuyện với đồng nghiệp ngoại quốc...\n\nNếu bạn cảm thấy khó khăn khi đạt được những thảo thuận với đối tác nước ngoài...\n\nNếu bạn phải làm việc với môi trường sử dụng tiếng anh là ngôn ngữ chính...\n\nVậy thì bạn cần khóa học Giao tiếp trong công việc bằng tiếng anh này.','09970000','https://static.edumall.vn/uploads/images/courses/thumbnail_nt06_570x345.png',NULL,'https://edumall.vn/courses/tieng-anh-ung-dung--tu-tin-giao-tiep-trong-cong-viec-bang-tieng-anh/detail','edumall.vn','349,000đ\nƯu đãi 42% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 10\nphút : 55\ngiây',0),(137,'Tiếng Anh ứng dụng: Giao dịch ngân hàng trong tiếng Anh','Topica Native','Nếu có cơ hội được sang một đất nước khác để du lịch hay để làm việc, điều đầu tiên bạn sẽ làm gì?\nTôi cá chắc rằng bạn sẽ phải trang bị cho mình vốn tiếng Anh tương đối để có thể giao tiếp hàng ngày.\nDo đó, chúng tôi dựa trên những nhu cầu thiết yếu này để xây dựng một khóa học vô cùng hữu ích đó là \"Giao dịch ngân hàng\" trong tuyển tập Tiếng Anh ứng dụng. Với phong cách truyền tải đầy màu sắc bằng các tình huống trực quan, chúng tôi sẽ giúp các bạn đạt được kết quả như mong muốn chỉ trong 1 giờ đồng hồ!','08900000','https://static.edumall.vn/uploads/images/courses/thumbnail_native.19.570-x-345.png',NULL,'https://edumall.vn/courses/tieng_anh_ung_dung_giao_dich_ngan_hang_trong_tieng_anh/detail','edumall.vn','349,000đ\nƯu đãi 42% chỉ còn :\n199,000đ\n02\nngày : 03\ngiờ : 12\nphút : 12\ngiây',0),(143,'Excel ứng dụng cho kế toán','Nguyễn Văn Kỳ','Kế toán luôn là một trong những ngành nghề thường xuyên xử lý rất nhiều số liệu và đòi hỏi sự chính xác cao. \nMỗi nhân viên kế toán đều cần thiết phải trang bị cho mình những kỹ năng nhất định để có thể làm việc nhanh và hiệu quả. Với tính năng tự động và khả năng xử lý thông tin thần tốc, Excel luôn là công cụ hỗ trợ đắc lực cho mỗi cá nhân hoạt động trong lĩnh vực chuyên môn này.\nĐến với khóa học \"Excel ứng dụng cho kế toán\", bạn sẽ được học những kiến thức thiết thực nhất để áp dụng trực tiếp vào công việc mà không cần mất chi phí để mua các phần mềm kế toán phức tạp.','08000009','https://static.edumall.vn/uploads/images/courses/thumbnail_thumbnail_nvk01_570x345.png',NULL,'https://edumall.vn/courses/excel-ung-dung-cho-ke-toan/detail','edumall.vn','599,000đ\nƯu đãi 50% chỉ còn :\n299,000đ\n02\nngày : 03\ngiờ : 07\nphút : 19\ngiây',0),(145,'Quản lý tài chính dành cho cá nhân và doanh nghiệp','Đoàn Cẩm Tú','Bạn thân mến, nếu bạn đang nghĩ rằng “Tôi sẽ quản lý khi mình có nhiều tiền”, có thể bạn đúng, nhưng hãy cân nhắc lại, bởi lập luận này không khác gì việc bạn nghĩ rằng: “Nếu có nhiều điểm 10, tôi sẽ cố gắng và chăm chỉ học tập“. Thực tế là “Nếu bạn không biết quản lý tốt những gì bạn đang có, những thứ tốt đẹp hơn sẽ chẳng bao giờ đến với bạn.” Vì vậy, việc học cách quản lý tài chính và áp dụng nó mỗi ngày sẽ cho bạn những cảm giác vô cùng tuyệt vời, là 1 thói quen vô cùng tốt.','08080000','http://academy.vn/wp-content/uploads/2015/05/Quan-ly-tai-chinh-academy-420x284.jpg',NULL,'http://academy.vn/course/quan-ly-tai-chinh-danh-cho-ca-nhan-va-doanh-nghiep/','academy.vn','1,000,000đ',0),(146,'Khoá luyện thi IELTS cấp tốc','Nguyễn Anh Tuấn','Khoá luyện thi IELTS cấp tốc với những kinh nghiêm quý báu giúp bạn rèn luyện 4 kỹ năng IELTS reading, IELTS Writing, IELTS Spearking & IELTS Listening được chia sẻ đầy đủ nhất trong chương trình này kèm tài liệu luyện thi IELTS Online. Không phải ngẫu nhiên mà IELTS là chứng chỉ được ưu tiên hàng đầu để các cơ quan có thẩm quyền xem xét và tiếp nhận các sinh viên quốc tế đến học tại các quốc gia có nền giáo dục cấp tiến sử dụng tiếng Anh là ngôn ngữ chính thức. Hiện tại IELTS là một kỳ thi quốc tế với hơn 270 trung tâm khảo thí ở 110 nước khác nhau.','00900000','http://academy.vn/wp-content/uploads/2014/08/Luyen-thi-ielts-cap-toc-420x237.jpg',NULL,'http://academy.vn/course/khoa-luyen-thi-ielts/','academy.vn','2,000,000đ',0),(147,'Lập kế hoạch Digital Marketing','Phạm Thu Trang','Một trong những yếu tố quyết định thành công của một kế hoạch Digital Marketing là phân tích. Bạn cần phân tích rõ thị trường và phân khúc khách hàng của bạn ở đâu? Bạn cần xác định đúng khách hàng tiềm năng của bạn và phân tích những hành vi cụ thể của họ. Ngoài ra bạn cũng nên dành một ít thời gian để phân tích đối thủ cạnh tranh chính. Khoá học này sẽ lần lượt giúp bạn nắm bắt được kiến thức cũng như kỹ năng lập kế hoạch, phân tích đánh giá 1 kế hoạch Digital Marketing.','49000000','http://academy.vn/wp-content/uploads/2014/09/Digital-marketing.jpg',NULL,'http://academy.vn/course/lap-ke-hoach-digital-marketing/','academy.vn','1,000,000đ',0),(148,'Quản lý thời gian và sắp xếp công việc hiệu quả','Vũ Thị Hoài Anh','Ai cũng có 168 giờ trong một tuần để hoàn thành các công việc được xếp vào dạng “ưu tiên”. Để tăng lượng thời gian này lên mức tối đa và để quản lý hiệu quả công việc hằng ngày của bạn, hãy tạo cho mình thói quen thường xuyên tổ chức các hoạt động, lịch làm việc, và cả sinh hoạt hàng tuần của mình nữa. Nếu bạn tiết kiệm mỗi ngày 1 giờ, mỗi năm bạn đã “dư ra” cho mình 365 giờ = 15 ngày trọn vẹn. Nhiều người đã lấy thêm bằng cấp, học lái xe, dự hội thảo nâng cao năng lực bản thân, viết sách, làm thêm việc kinh doanh nhỏ từ thời gian rảnh rỗi của mình. Họ không thông minh hơn người khác, không tài năng hơn; họ chỉ tôn trọng và sử dụng nghiêm túc thời gian.','00090000','http://academy.vn/wp-content/uploads/2014/12/Ky-nang-quan-ly-thoi-gian-420x219.jpg',NULL,'http://academy.vn/course/ky-nang-quan-ly-thoi-gian/','academy.vn','300,000đ',0),(149,'Kỹ năng thuyết trình & nghệ thuật nói trước đám đông','Trần Đình Tuấn','Với hầu hết các nhóm công việc hiện đại, thì bất cứ khi nào chúng ta mong muốn trình bày kế hoạch, nói chuyện trước đám đông, kỹ năng thuyết trình cũng là một kỹ năng mấu chốt cần có. Thuyết trình không còn là “trình bày, thuyết minh”, mà đã trở thành một nghệ thuật được sử dụng trong việc thu phục nhân tâm, tạo động lực cho những người xung quanh. Bạn đang tìm hiểu khoá học này, có thể bạn đang:','00090000','http://academy.vn/wp-content/uploads/2015/05/Ky-nang-thuyet-trinh-va-noi-truoc-cong-chung-420x276.jpg',NULL,'http://academy.vn/course/ky-nang-thuyet-trinh/','academy.vn','350,000đ',0),(150,'Kỹ năng giao tiếp ứng xử dành cho người đi làm','Nguyễn Hoàng Khắc Hiếu','Và chắc hẳn bạn cũng đã từng tìm kiếm những lớp học giao tiếp nhưng địa điểm quá xa nên không tham dự được? Chi phí thì 2-3 triệu cho một khóa mà không biết có hiệu quả hay không? Để  giải quyết vấn đề này, học Online tại nhà bất cứ lúc nào có thể sẽ là giải pháp tối ưu cho bạn. Đây là chương trình được xây dựng bởi cổng đào tạo trực tuyến Academy.vn: Kỹ năng cho người đi làm phối hợp cùng giảng viên – Chuyên gia tâm lý Nguyễn Hoàng Khắc Hiếu. Toàn bộ chương trình này được biên soạn công phu, tỉ mỉ và chuyên sâu thông qua những hướng dẫn chi tiết, cụ thể nhằm dẫn dắt bạn từng bước chinh phục được kỹ năng giao tiếp ứng xử của mình và áp dụng kỹ năng này vào công việc cũng như cuộc sống hàng ngày.','04090000','http://academy.vn/wp-content/uploads/2014/12/Ky-nang-giao-tiep-420x219.jpg',NULL,'http://academy.vn/course/khoa-hoc-ky-nang-giao-tiep/','academy.vn','300,000đ',0),(151,'Nghệ thuật chinh phục khách hàng & Kỹ năng bán hàng đỉnh cao','Lê Văn Phán','–        Mỗi chúng ta đều cảm nhận thức được điều cốt lõi trong kinh doanh là làm sao chinh phục và giữ chân được khách hàng? Công việc kinh doanh, thành công hay thất bại, phát triển hay suy tàn, phụ thuộc vào rất nhiều cách chúng ta phát triển khách hàng ra sao, cách thức để thu hút và giữ chân khách hàng?','09030000','http://academy.vn/wp-content/uploads/2015/05/Ky-nang-ban-hang-chuyen-nghiep-420x247.jpg',NULL,'http://academy.vn/course/ky-nang-ban-hang/','academy.vn','500,000đ',0),(152,'Kỹ năng tìm việc làm và tạo sự thăng tiến trong nghề nghiệp','Trang Minh Hà','Bạn có biết:','09040000','http://academy.vn/wp-content/uploads/2014/09/Phong-van-xin-viec-420x228.jpg',NULL,'http://academy.vn/course/ky-nang-phong-van-xin-viec/','academy.vn','250,000đ',0),(153,'Khám phá thế mạnh bản thân – Làm sao để tự tin?','Nguyễn Hoàng Khắc Hiếu','Việc khó nhất để đưa bạn đến thành công trong tương lại chính là bạn phải hiểu bản thân mình ở hiện tại. Bạn cần phải hiểu mình đang sống ở hoàn cảnh nào, thế mạnh bản thân mình là gì, mình nên làm gì để đạt được thành công trong tương lai, đừng sai lầm mà dành toàn bộ thời gian của mình vào những công việc không đem lại hạnh phúc cho bạn. Thay vào đó bạn nên dùng một phần thời gian của mình để khám phá chính b