g ta cùng điểm qua thông tin về 2 cấp độ trước khi bước vào cấp độ thứ 3 của chương trình tiếng anh dành cho người mất căn bản:','00900000','http://academy.vn/wp-content/uploads/2014/09/Hoc-tieng-anh-online1-420x227.jpg',NULL,'http://academy.vn/course/ngu-phap-tieng-anh/','academy.vn','300,000đ',0),(157,'Đào tạo Google AdWords từ cơ bản đến chuyên sâu','Mai Xuân Đạt SEOngon','Chương trình đào tạo thực hành Google AdWords do cổng đào tạo trực tuyến Academy.vn phối hợp cùng giảng viên Mai Xuân Đạt nhằm cung cấp cho bạn các kiến thức cốt lõi và cần thiết nhất khi chạy quảng cáo Google Adwords.','58000000','http://academy.vn/wp-content/uploads/2014/08/Khoa-hoc-Google-AdWords-420x248.jpg',NULL,'http://academy.vn/course/khoa-hoc-google-adwords/','academy.vn','1,000,000đ',0),(158,'Khoá học SEO Online (Search Engine Optimization)','Nguyễn Quốc Anh','Bạn thân mến, bạn đang theo dõi khoá học này, nghĩa là bạn đang quan tâm tới những kỹ thuật nhằm đưa website của bạn xuất hiện nhiều hơn trên bộ máy tìm kiếm của Google nhưng bạn chưa biết bắt đầu từ đâu, bạn chưa biết phải sử dụng những công cụ SEO nào để theo dõi và đánh giá website của mình, cũng như bạn chưa hiểu rõ về các yếu tố xếp hạng của Google trên bộ máy tìm kiếm….','58000000','http://academy.vn/wp-content/uploads/2014/08/Khoa-hoc-SEO-Online-420x280.jpg',NULL,'http://academy.vn/course/khoa-hoc-seo-online/','academy.vn','990,000đ',0),(159,'Bí quyết học tiếng anh cho người mới bắt đầu','Nguyễn Anh Tuấn','Lưu ý: Đây là khoá học thử miễn phí nội dung chỉ bao gồm 30 phút nhằm giúp học viên làm quen với việc học trực tuyến cũng như phương pháp đào tạo các khoá học tại Academy.vn, Bạn có thể Click vào nút đăng ký học ngay ở trên để bắt đầu tham gia.','00900000','http://academy.vn/wp-content/uploads/2014/09/Hoc-tieng-anh-420x219.jpg',NULL,'http://academy.vn/course/phuong-phap-hoc-tieng-anh/','academy.vn','Miễn phí',0),(160,'Chương trình đào tạo lập trình viên iOS chuyên nghiệp','Nguyễn Minh Khoái','Bạn có biết:','90000000','h