arketing-420x199.jpg',NULL,'http://academy.vn/course/khoa-hoc-facebook-marketing/','academy.vn','990,000đ',0),(164,'Khoá học Digital Marketing căn bản','Academy.vn','Bạn có biết:','49000000','http://academy.vn/wp-content/uploads/2014/12/Khoa-hoc-digital-marketing-academy-420x261.jpg',NULL,'http://academy.vn/course/khoa-hoc-digital-marketing/','academy.vn','400,000đ',0),(165,'Khoá học lập trình Android cơ bản','Academy.vn','Ưu thế nổi bật nhất phải kể đến của Android là hệ mã nguồn mở. Android đã thu hút rất nhiều nhà phát triển từ khắp mọi nơi khi Goole phân phối miễn phí Android và các đoạn mã có bản quyền cho bất cứ ai muốn tham gia phát triển phần mềm cho Goole. Lập trình ứng dụng Android sẽ đem lại cho chúng ta những công cụ cần thiết, những kiến thức cơ bản giúp chúng ta tiến gần hơn tới vị trí của một lập trình viên, một nhà phát triển chuyên nghiệp, hoặc chỉ đơn giản là thỏa sức sáng tạo ra những ứng dụng hữu ích cho cuộc sống.','90000000','http://academy.vn/wp-content/uploads/2014/06/Khoa-hoc-lap-trinh-android-420x236.jpg',NULL,'http://academy.vn/course/khoa-hoc-lap-trinh-android-co-ban/','academy.vn','990,000đ',0),(166,'Xây dựng chiến lược Internet Marketing','Phạm Thu Trang','Sự bùng nổ của internet trong thời gian vừa qua, đã kéo theo sự phát triển của các công cụ cũng như kênh truyền thông cho doanh nghiệp. Điều này tạo ra cơ hội lớn hơn để doanh nghiệp của bạn có thể tiếp cận khách hàng nhưng cũng đặt ra những thách thức không nhỏ cho chủ doanh nghiệp cũng như người làm Marketing. Bởi để thành công trên Internet, ngoài việc bạn hiểu rõ và thành thạo trong việc sử dụng các công cụ Digital Marketing thì ý tưởng, chiến lược và kế hoạch hành động mới là yếu tố quyết định mức độ thành công của bạn trên môi trường Internet.','49000000','http://academy.vn/wp-content/uploads/2015/03/hoc-Internet-marketing-420x240.jpg',NULL,'http://academy.vn/course/dao-tao-internet-marketing/','academy.vn','990,000đ',0),(167,'Chiến lược bán hàng trên Facebook qua Profile cá nhâ