m','SMS Marketing căn bản - Vũ Hoàng Tâm - kyna.vn','09000000','https://lh5.googleusercontent.com/-44-D3YeGsCg/VNBzf_FR5_I/AAAAAAAAK8s/kGkkU6B_1jw/s500/kh%25C3%25B3a%2520sms.jpg\");',NULL,'https://kyna.vn/khoa-hoc/sms-marketing-can-ban','kyna.vn','99.000đ',0),(310,'Kỹ năng xin việc làm đảm bảo đậu','Nguyễn Vũ Đức Thuận','Kỹ năng xin việc làm đảm bảo đậu - Nguyễn Vũ Đức Thuận - kyna.vn','08090000','https://lh4.googleusercontent.com/-Ps0cGvEr9S4/VNBzbbV2EtI/AAAAAAAAK7k/YatFsZYK4J0/s360/Kh%25C3%25B3a%2520xin%2520vi%25E1%25BB%2587c.jpg\");',NULL,'https://kyna.vn/khoa-hoc/ky-nang-xin-viec-lam-dam-bao-dau','kyna.vn','20.000đ',0),(311,'Làm Sales chuyên nghiệp – Bí quyết vua bán hàng','Nguyễn Kiên Trì','Làm Sales chuyên nghiệp – Bí quyết vua bán hàng - Nguyễn Kiên Trì - kyna.vn','09000000','https://lh4.googleusercontent.com/-cISHSBo9Qi0/VNBzzHWjaBI/AAAAAAAAK-o/RUXMm2Uxgk0/s800/Khoa_lam%2520sales%2520chuyen%2520nghiep.jpg\");',NULL,'https://kyna.vn/khoa-hoc/lam-sales-chuyen-nghiep--bi-quyet-vua-ban-hang','kyna.vn','250.000đ',0),(314,'Khoá Học \"Thành Thạo PowerPoint trong 10 Giờ\"','Hồ Trần Hiếu Trung','- Bạn đang là một chuyên viên Marketing? một nhà tổ chức sự kiện chuyên nghiệp?\n\n- Bạn lúng túng với việc trình bày thật ấn tượng ý tưởng hay kế hoạch trên PowerPoint?\n\n- Bạn là sinh viên đang muốn trình bày bài thuyết trình của mình thật nổi bật?\n\n- Bạn là giáo viên, giảng viên và muốn ứng dụng PowerPoint làm bài giảng của mình thêm sinh động, lôi cuốn hơn?\n\n- Hay đơn giản, bạn chỉ muốn hiểu rõ nguyên tắc để tạo ra một bài PowerPoint chuẩn.\n\nVà đây, khóa học trực tuyến “Thành Thạo PowerPoint trong 10 Giờ” sẽ giúp bạn hiểu rõ các kỹ năng cần thiết từ cơ bản đến nâng cao để tạo nên bài báo cáo, trình bày ý tưởng bằng PowerPoint một cách nhanh chóng, hiệu quả và ấn tượng nhất, đúng như một chuyên gia.','30000009','http://3hoc.vn/uploads/classes/norms/3hoc_d30582c3_3hoc-khoa-hoc-PowerPoint-2010-chuyen-nghiep.jpg',NULL,'http://3hoc.vn/vi/learn/detail/70-khoa-hoc-powerpoint-chuyen-nghiep/','3hoc.vn','199.000đ',0),(315,'Khoá học \"Thành thạo MS Word văn phòng từ A đến Z\"','Trần Đình Vĩ','- Bạn đang chuẩn bị làm đề tài, luận án tốt nghiệp, viết CV hay cần soạn kế hoạch kinh doanh?\n\n- Mỗi lần thay đổi nội dung trong đề tài hay bản kế hoạch là bạn phải vào mục lục điều chỉnh số trang, kiểm tra từng trang một để cập nhật lại chú thích và số trang một cách thủ công?\n\n- Nếu là đề tài nhóm, bạn có biết cách chỉnh sửa bài của nhau mà vẫn giữ nguyên văn bản gốc?\n\n- Hình ảnh chèn trong văn bản cứ nhảy lung tung không kiểm soát được?\n\n- Bạn Enter xuống dòng liên tục chỉ để nhảy sang trang mới cho phần tiếp theo?\n\n- Bạn nhập chữ i viết thường nhưng Word cứ đổi thành chữ I viết hoa?\n\n- Việc đánh số thứ tự bị nhảy số hoặc lệch dòng không theo ý bạn?\n\n- Soạn thư cho hàng ngàn khách mời với danh sách thông tin có sẵn cũng khiến bạn đau đầu?\n\nTất cả những vấn đề tưởng chừng hóc búa này đều được giải quyết nhanh gọn khi bạn hiểu rõ và sử dụng đúng các tính năng có sẵn trong Word. Khóa học trực tuyến “Thành thạo MS Word văn phòng từ A đến Z” ra đời cũng nhằm giúp bạn tự tin và dễ dàng sử','30000009','http://3hoc.vn/uploads/classes/norms/3hoc_31bef4d9_3hoc-khoa-hoc-Word-2010-chuyen-nghiep.jpg',NULL,'http://3hoc.vn/vi/learn/detail/71-khoa-hoc-microsoft-word-van-phong-chuyen-nghiep-a-z/','3hoc.vn','249.000đ',0),(316,'Khóa học \"Thành thạo Excel văn phòng trong 8 giờ\"','Phạm Thanh Hà','- Bạn đang là sinh viên các ngành Kinh Tế, Ngân Hàng, Tài Chính, Kế Toán?\n\n- Bạn đang muốn lấy Chứng Chỉ A Tin Học Văn Phòng để dễ dàng xin việc?\n\n- Bạn đã đếm từng dòng dữ liệu khi bị yêu cầu thống kế dữ liệu nào đó trong Excel?\n\n- Hàm VLOOKUP bạn sử dụng cho ra kết quả ERROR?\n\n- Việc nhập liệu với bạn thật nhàm chán, tốn nhiều thời gian?\n\n- Bạn đã từng vò đầu bứt tai chỉ để nhập số điện thoại di động 09… vào ô tính của Excel mà không bị Excel xoá mất số 0?\n\n- Hay đơn giản là bạn muốn học Excel để phục vụ cho công việc dễ dàng hơn?\n\nCòn nhiều nữa những vấn đề mà bạn gặp phải khi đối diện với Excel. Vậy thì làm sao để có thể chinh phục được phần mềm khó tính này?\n\nĐây chính là giải pháp của chúng tôi dành cho bạn, khóa học trực tuyến “Thành thạo Excel văn phòng trong 8 giờ” sẽ giúp bạn trở nên chuyên nghiệp hơn, xử lý vấn đề dễ dàng hơn khi ứng dụng Excel vào công việc.','30000009','http://3hoc.vn/uploads/classes/norms/3hoc_a40e6a44_khoa-hoc-ky-nang-Excel-2010.jpg',NULL,'http://3hoc.vn/vi/learn/detail/69-khoa-hoc-excel-chuyen-nghiep/','3hoc.vn','399.000đ',0);
